VALUES
	(1,7747,'revelation-7-is-an-amazing-chapter-john-takes-a-moment-between-the-6th-and-7th-seals-to-explain-a-bit-about-the-144000-sealed-believers-and-the-tribulation-saints-we-are-able-to-take-in-an-amazing-picture-of-what-is-going-in-heaven-during-this-time','Revelation 7 is an amazing chapter. John takes a moment, between the 6th and 7th seals to explain a bit about the 144,000 sealed believers and the tribulation saints. We are able to take in an amazing picture of what is going in heaven during this time.','revelation-7-is-an-amazing-chapter-john-takes-a-moment-between-the-6th-and-7th-seals-to-explain-a-bit-about-the-144000-sealed-believers-and-the-tribulation-saints-we-are-able-to-take-in-an-amazing-picture-of-what-is-going-in-heaven-during-this-time','Revelation 7 is an amazing chapter. John takes a moment, between the 6th and 7th seals to explain a bit about the 144,000 sealed believers and the tribulation saints. We are able to take in an amazing picture of what is going in heaven during this time.',47,'<p>Revelation 7 is an amazing chapter. John takes a moment, between the 6th and 7th seals to explain a bit about the 144,000 sealed believers and the tribulation saints. We are able to take in an amazing picture of what is going in heaven during this time.</p>'),
	(2,7743,'in-revelation-5-a-drama-begins-to-unfold-in-heaven-john-sees-a-scroll-and-is-distraught-over-the-fact-that-no-one-is-able-to-open-it-then-the-lamb-appears-our-focus-tonight-is-on-our-messiah-our-redeemer-the-one-who-is-worthy-to-open-the-scroll-and-its-se','In Revelation 5, a drama begins to unfold in heaven. John sees a scroll and is distraught over the fact that no one is able to open it. Then the Lamb appears. Our focus tonight is on our Messiah, our Redeemer, the One who is worthy to open the scroll and its seals.','in-revelation-5-a-drama-begins-to-unfold-in-heaven-john-sees-a-scroll-and-is-distraught-over-the-fact-that-no-one-is-able-to-open-it-then-the-lamb-appears-our-focus-tonight-is-on-our-messiah-our-redeemer-the-one-who-is-worthy-to-open-the-scroll-and-its-se','In Revelation 5, a drama begins to unfold in heaven. John sees a scroll and is distraught over the fact that no one is able to open it. Then the Lamb appears. Our focus tonight is on our Messiah, our Redeemer, the One who is worthy to open the scroll and its seals.',53,'<p>In Revelation 5, a drama begins to unfold in heaven. John sees a scroll and is distraught over the fact that no one is able to open it. Then the Lamb appears. Our focus tonight is on our Messiah, our Redeemer, the One who is worthy to open the scroll and its seals.</p>'),
	(3,7741,'romans-9-10-and-11-delve-further-into-the-answer-to-this-question-what-must-one-do-to-be-saved-in-romans-10-we-see-that-paul-talks-about-the-reasons-why-people-reject-salvation-the-reality-of-their-rejection-and-the-results-of-their-rejection','Romans 9, 10, and 11 delve further into the answer to this question: What must one do to be saved? In Romans 10, we see that Paul talks about the reasons why people reject salvation, the reality of their rejection, and the results of their rejection.','romans-9-10-and-11-delve-further-into-the-answer-to-this-question-what-must-one-do-to-be-saved-in-romans-10-we-see-that-paul-talks-about-the-reasons-why-people-reject-salvation-the-reality-of-their-rejection-and-the-results-of-their-rejection','Romans 9, 10, and 11 delve further into the answer to this question: What must one do to be saved? In Romans 10, we see that Paul talks about the reasons why people reject salvation, the reality of their rejection, and the results of their rejection.',46,'<p>Romans 9, 10, and 11 delve further into the answer to this question: What must one do to be saved? In Romans 10, we see that Paul talks about the reasons why people reject salvation, the reality of their rejection, and the results of their rejection.</p>'),
	(4,7738,'romans-9-through-11-is-a-crucial-passage-regarding-the-jews-and-the-plans-that-the-lord-still-has-for-them-in-a-day-and-age-when-replacement-theology-seems-to-be-gaining-ground-these-chapters-are-essential-for-our-understanding-we-take-a-deeper-look-tonig','Romans 9 through 11 is a crucial passage regarding the Jews and the plans that the Lord still has for them. In a day and age when Replacement Theology seems to be gaining ground, these chapters are essential for our understanding. We take a deeper look tonight at chapter 9 and the promises God has made to His chosen people.','romans-9-through-11-is-a-crucial-passage-regarding-the-jews-and-the-plans-that-the-lord-still-has-for-them-in-a-day-and-age-when-replacement-theology-seems-to-be-gaining-ground-these-chapters-are-essential-for-our-understanding-we-take-a-deeper-look-tonig','Romans 9 through 11 is a crucial passage regarding the Jews and the plans that the Lord still has for them. In a day and age when Replacement Theology seems to be gaining ground, these chapters are essential for our understanding. We take a deeper look tonight at chapter 9 and the promises God has made to His chosen people.',60,'<p>Romans 9 through 11 is a crucial passage regarding the Jews and the plans that the Lord still has for them. In a day and age when Replacement Theology seems to be gaining ground, these chapters are essential for our understanding. We take a deeper look tonight at chapter 9 and the promises God has made to His chosen people.</p>'),
	(5,7740,'as-we-examine-the-letter-to-the-church-at-laodicea-we-find-that-there-are-many-correlations-between-that-church-and-the-greater-church-today-this-teaching-highlights-the-dangers-of-relativism-and-liberalism-within-the-church-which-seem-to-be-growing-trend','As we examine the letter to the church at Laodicea, we find that there are many correlations between that church and the greater church today. This teaching highlights the dangers of relativism and liberalism within the church, which seem to be growing trends. What is the solution?  We need to make sure that Jesus is at home, not only in our hearts, but in our churches as well.','as-we-examine-the-letter-to-the-church-at-laodicea-we-find-that-there-are-many-correlations-between-that-church-and-the-greater-church-today-this-teaching-highlights-the-dangers-of-relativism-and-liberalism-within-the-church-which-seem-to-be-growing-trend','As we examine the letter to the church at Laodicea, we find that there are many correlations between that church and the greater church today. This teaching highlights the dangers of relativism and liberalism within the church, which seem to be growing trends. What is the solution?  We need to make sure that Jesus is at home, not only in our hearts, but in our churches as well.',69,'<p>As we examine the letter to the church at Laodicea, we find that there are many correlations between that church and the greater church today. This teaching highlights the dangers of relativism and liberalism within the church, which seem to be growing trends. What is the solution?  We need to make sure that Jesus is at home, not only in our hearts, but in our churches as well.</p>'),
	(6,7735,'in-our-text-jesus-is-described-as-a-stone-we-take-a-look-at-several-passages-in-scripture-that-give-us-deeper-insight-into-the-richness-of-this-picture-the-bottom-line-is-that-jesus-is-a-rock-the-question-for-us-is-whether-we-will-humble-ourselves-and-be','In our text, Jesus is described as a stone. We take a look at several passages in scripture that give us deeper insight into the richness of this picture. The bottom line is that Jesus IS a rock. The question for us is whether we will humble ourselves and be broken before Him, or whether we will harden ourselves and be broken by Him. There are many wonderful applications for us from this passage.','in-our-text-jesus-is-described-as-a-stone-we-take-a-look-at-several-passages-in-scripture-that-give-us-deeper-insight-into-the-richness-of-this-picture-the-bottom-line-is-that-jesus-is-a-rock-the-question-for-us-is-whether-we-will-humble-ourselves-and-be','In our text, Jesus is described as a stone. We take a look at several passages in scripture that give us deeper insight into the richness of this picture. The bottom line is that Jesus IS a rock. The question for us is whether we will humble ourselves and be broken before Him, or whether we will harden ourselves and be broken by Him. There are many wonderful applications for us from this passage.',74,'<p>In our text, Jesus is described as a stone. We take a look at several passages in scripture that give us deeper insight into the richness of this picture. The bottom line is that Jesus IS a rock. The question for us is whether we will humble ourselves and be broken before Him, or whether we will harden ourselves and be broken by Him. There are many wonderful applications for us from this passage.</p>'),
	(7,7737,'as-we-continue-our-study-through-the-book-of-revelation-we-take-a-closer-look-at-the-church-in-thyatira-found-in-revelation-2-18-29-we-see-that-while-they-are-praised-for-their-love-service-faith-and-patience-they-struggle-greatly-with-fornication-and-ido','As we continue our study through the book of Revelation, we take a closer look at the church in Thyatira, found in Revelation 2:18-29. We see that while they are praised for their love, service, faith, and patience, they struggle greatly with fornication and idolatry. The application for today is realizing that if there is something more important to us than the Lord, it becomes idolatry, which is something that we as a church need to stay away from.','as-we-continue-our-study-through-the-book-of-revelation-we-take-a-closer-look-at-the-church-in-thyatira-found-in-revelation-2-18-29-we-see-that-while-they-are-praised-for-their-love-service-faith-and-patience-they-struggle-greatly-with-fornication-and-ido','As we continue our study through the book of Revelation, we take a closer look at the church in Thyatira, found in Revelation 2:18-29. We see that while they are praised for their love, service, faith, and patience, they struggle greatly with fornication and idolatry. The application for today is realizing that if there is something more important to us than the Lord, it becomes idolatry, which is something that we as a church need to stay away from.',79,'<p>As we continue our study through the book of Revelation, we take a closer look at the church in Thyatira, found in Revelation 2:18-29. We see that while they are praised for their love, service, faith, and patience, they struggle greatly with fornication and idolatry. The application for today is realizing that if there is something more important to us than the Lord, it becomes idolatry, which is something that we as a church need to stay away from.</p>'),
	(8,7734,'tonight-in-our-through-the-bible-study-we-continue-to-look-at-romans-8-28-39-pastor-brett-further-explains-the-concepts-of-predestination-and-foreknowledge-and-how-the-lord-has-a-perfect-plan-for-all-of-our-lives','Tonight, in our through-the-Bible study, we continue to look at Romans 8:28-39. Pastor Brett further explains the concepts of predestination and foreknowledge, and how the Lord has a perfect plan for all of our lives.','tonight-in-our-through-the-bible-study-we-continue-to-look-at-romans-8-28-39-pastor-brett-further-explains-the-concepts-of-predestination-and-foreknowledge-and-how-the-lord-has-a-perfect-plan-for-all-of-our-lives','Tonight, in our through-the-Bible study, we continue to look at Romans 8:28-39. Pastor Brett further explains the concepts of predestination and foreknowledge, and how the Lord has a perfect plan for all of our lives.',35,'<p>Tonight, in our through-the-Bible study, we continue to look at Romans 8:28-39. Pastor Brett further explains the concepts of predestination and foreknowledge, and how the Lord has a perfect plan for all of our lives.</p>'),
	(9,7732,'as-we-continue-our-study-through-romans-paul-discusses-the-concepts-of-sin-redemption-mercy-and-grace-further-in-chapter-8-he-writes-about-how-there-is-no-condemnation-to-those-who-are-in-christ-jesus-pastor-brett-talks-about-condemnation-vs-conviction-h','As we continue our study through Romans, Paul discusses the  concepts of sin, redemption, mercy, and grace further. In chapter 8, he writes about how there is no condemnation to those who are in Christ Jesus. Pastor Brett talks about condemnation vs. conviction, how we have no obligation to the flesh, and how we have the hope of heaven.','as-we-continue-our-study-through-romans-paul-discusses-the-concepts-of-sin-redemption-mercy-and-grace-further-in-chapter-8-he-writes-about-how-there-is-no-condemnation-to-those-who-are-in-christ-jesus-pastor-brett-talks-about-condemnation-vs-conviction-h','As we continue our study through Romans, Paul discusses the  concepts of sin, redemption, mercy, and grace further. In chapter 8, he writes about how there is no condemnation to those who are in Christ Jesus. Pastor Brett talks about condemnation vs. conviction, how we have no obligation to the flesh, and how we have the hope of heaven.',60,'<p>As we continue our study through Romans, Paul discusses the  concepts of sin, redemption, mercy, and grace further. In chapter 8, he writes about how there is no condemnation to those who are in Christ Jesus. Pastor Brett talks about condemnation vs. conviction, how we have no obligation to the flesh, and how we have the hope of heaven.</p>'),
	(10,7730,'tonight-we-read-revelation-3-7-13-where-we-take-a-closer-look-at-the-church-in-philadelphia-the-city-of-brotherly-love-the-personal-application-we-find-here-is-the-importance-of-evangelism-in-the-church-and-how-essential-it-is-to-tell-all-the-world-about','Tonight, we read Revelation 3:7-13, where we take a closer look at the church in Philadelphia, the city of brotherly love. The personal application we find here is the importance of evangelism in the church, and how essential it is to tell all the world about the gospel.','tonight-we-read-revelation-3-7-13-where-we-take-a-closer-look-at-the-church-in-philadelphia-the-city-of-brotherly-love-the-personal-application-we-find-here-is-the-importance-of-evangelism-in-the-church-and-how-essential-it-is-to-tell-all-the-world-about','Tonight, we read Revelation 3:7-13, where we take a closer look at the church in Philadelphia, the city of brotherly love. The personal application we find here is the importance of evangelism in the church, and how essential it is to tell all the world about the gospel.',48,'<p>Tonight, we read Revelation 3:7-13, where we take a closer look at the church in Philadelphia, the city of brotherly love. The personal application we find here is the importance of evangelism in the church, and how essential it is to tell all the world about the gospel.</p>'),
	(11,7729,'in-romans-7-paul-continues-to-talk-about-the-sinful-nature-of-man-and-the-battle-between-the-flesh-and-the-spirit-brett-gives-us-an-outline-based-on-what-paul-writes-discussing-the-sinful-condition-that-we-find-ourselves-in-to-the-conqueror-of-said-condit','In Romans 7, Paul continues to talk about the sinful nature of man, and the battle between the flesh and the spirit. Brett gives us an outline based on what Paul writes, discussing the sinful condition that we find ourselves in, to the conqueror of said condition, to the conclusion: If we want to see victory over the flesh, we need to walk in the spirit.','in-romans-7-paul-continues-to-talk-about-the-sinful-nature-of-man-and-the-battle-between-the-flesh-and-the-spirit-brett-gives-us-an-outline-based-on-what-paul-writes-discussing-the-sinful-condition-that-we-find-ourselves-in-to-the-conqueror-of-said-condit','In Romans 7, Paul continues to talk about the sinful nature of man, and the battle between the flesh and the spirit. Brett gives us an outline based on what Paul writes, discussing the sinful condition that we find ourselves in, to the conqueror of said condition, to the conclusion: If we want to see victory over the flesh, we need to walk in the spirit.',66,'<p>In Romans 7, Paul continues to talk about the sinful nature of man, and the battle between the flesh and the spirit. Brett gives us an outline based on what Paul writes, discussing the sinful condition that we find ourselves in, to the conqueror of said condition, to the conclusion: If we want to see victory over the flesh, we need to walk in the spirit.</p>'),
	(12,7724,'as-we-study-through-romans-5-tonight-we-find-the-theme-of-justification-is-something-to-celebrate-our-focus-is-on-the-many-blessings-we-have-as-the-result-of-this-important-doctrinal-truth','As we study through Romans 5 tonight we find the theme of justification is something to celebrate!  Our focus is on the many blessings we have as the result of this important doctrinal truth.','as-we-study-through-romans-5-tonight-we-find-the-theme-of-justification-is-something-to-celebrate-our-focus-is-on-the-many-blessings-we-have-as-the-result-of-this-important-doctrinal-truth','As we study through Romans 5 tonight we find the theme of justification is something to celebrate!  Our focus is on the many blessings we have as the result of this important doctrinal truth.',35,'<p>As we study through Romans 5 tonight we find the theme of justification is something to celebrate!  Our focus is on the many blessings we have as the result of this important doctrinal truth.</p>'),
	(13,7723,'the-bible-promises-trials-and-tribulations-and-yet-they-always-seem-to-take-us-by-surprise-this-morning-we-look-at-some-of-the-ways-the-lord-redeems-these-hard-times-in-our-lives-for-anyone-lacking-hope-this-is-a-great-message-of-encouragement','The Bible promises trials and tribulations, and yet they always seem to take us by surprise. This morning we look at some of the ways the Lord redeems these hard times in our lives. For anyone lacking hope, this is a great message of encouragement!','the-bible-promises-trials-and-tribulations-and-yet-they-always-seem-to-take-us-by-surprise-this-morning-we-look-at-some-of-the-ways-the-lord-redeems-these-hard-times-in-our-lives-for-anyone-lacking-hope-this-is-a-great-message-of-encouragement','The Bible promises trials and tribulations, and yet they always seem to take us by surprise. This morning we look at some of the ways the Lord redeems these hard times in our lives. For anyone lacking hope, this is a great message of encouragement!',45,'<p>The Bible promises trials and tribulations, and yet they always seem to take us by surprise. This morning we look at some of the ways the Lord redeems these hard times in our lives. For anyone lacking hope, this is a great message of encouragement!</p>'),
	(14,7722,'our-focus-tonight-is-on-the-elements-of-justification-as-paul-takes-a-close-look-at-what-it-means-for-us-as-believers','Our focus tonight is on the elements of justification as Paul takes a close look at what it means for us as believers.','our-focus-tonight-is-on-the-elements-of-justification-as-paul-takes-a-close-look-at-what-it-means-for-us-as-believers','Our focus tonight is on the elements of justification as Paul takes a close look at what it means for us as believers.',23,'<p>Our focus tonight is on the elements of justification as Paul takes a close look at what it means for us as believers.</p>'),
	(15,7721,'too-many-people-walk-through-life-feeling-that-they-are-a-disappointment-to-god-today-we-take-a-look-at-this-common-misunderstanding-in-light-of-what-the-bible-says-about-how-the-lord-has-dealt-with-our-sin','Too many people walk through life feeling that they are a disappointment to God. Today, we take a look at this common misunderstanding in light of what the Bible says about how the Lord has dealt with our sin.','too-many-people-walk-through-life-feeling-that-they-are-a-disappointment-to-god-today-we-take-a-look-at-this-common-misunderstanding-in-light-of-what-the-bible-says-about-how-the-lord-has-dealt-with-our-sin','Too many people walk through life feeling that they are a disappointment to God. Today, we take a look at this common misunderstanding in light of what the Bible says about how the Lord has dealt with our sin.',39,'<p>Too many people walk through life feeling that they are a disappointment to God. Today, we take a look at this common misunderstanding in light of what the Bible says about how the Lord has dealt with our sin.</p>'),
	(16,7720,'the-bible-shows-us-that-the-lord-loves-us-no-matter-what-weve-done-even-though-we-dont-deserve-it-jesus-gave-us-the-gift-of-eternal-life-in-romans-4-paul-introduces-this-concept-to-the-jews-using-abraham-and-sarahs-story-as-an-example','The Bible shows us that the Lord loves  us, no matter what weve done. Even though we dont deserve it, Jesus gave us the gift of eternal life. In Romans 4, Paul introduces this concept to the Jews, using Abraham and Sarahs story as an example.','the-bible-shows-us-that-the-lord-loves-us-no-matter-what-weve-done-even-though-we-dont-deserve-it-jesus-gave-us-the-gift-of-eternal-life-in-romans-4-paul-introduces-this-concept-to-the-jews-using-abraham-and-sarahs-story-as-an-example','The Bible shows us that the Lord loves  us, no matter what weve done. Even though we dont deserve it, Jesus gave us the gift of eternal life. In Romans 4, Paul introduces this concept to the Jews, using Abraham and Sarahs story as an example.',47,'<p>The Bible shows us that the Lord loves  us, no matter what weve done. Even though we dont deserve it, Jesus gave us the gift of eternal life. In Romans 4, Paul introduces this concept to the Jews, using Abraham and Sarahs story as an example.</p>'),
	(17,7718,'in-the-letter-to-the-church-at-sardis-we-find-a-message-for-the-protestant-church-today-the-church-is-warned-about-spiritual-deadness-and-is-encouraged-to-strengthen-what-remains-for-us-today-the-message-is-clear-we-must-stay-faithful-to-studying-gods-w','In the letter to the church at Sardis, we find a message for the Protestant Church today. The church is warned about spiritual deadness and is encouraged to strengthen what remains. For us today, the message is clear - we must stay faithful to studying Gods Word!','in-the-letter-to-the-church-at-sardis-we-find-a-message-for-the-protestant-church-today-the-church-is-warned-about-spiritual-deadness-and-is-encouraged-to-strengthen-what-remains-for-us-today-the-message-is-clear-we-must-stay-faithful-to-studying-gods-w','In the letter to the church at Sardis, we find a message for the Protestant Church today. The church is warned about spiritual deadness and is encouraged to strengthen what remains. For us today, the message is clear - we must stay faithful to studying Gods Word!',47,'<p>In the letter to the church at Sardis, we find a message for the Protestant Church today. The church is warned about spiritual deadness and is encouraged to strengthen what remains. For us today, the message is clear - we must stay faithful to studying Gods Word!</p>'),
	(18,7717,'as-we-study-through-romans-2-paul-presents-his-readers-with-a-tough-challenge-while-we-all-have-the-tendency-to-focus-on-the-outward-paul-reminds-that-that-god-is-more-interested-in-our-hearts-in-that-light-none-of-us-measure-up-which-makes-the-lords-kind','As we study through Romans 2, Paul presents his readers with a tough challenge. While we all have the tendency to focus on the outward, Paul reminds that that God is more interested in our hearts. In that light, none of us measure up, which makes the Lords kindness all the sweeter.','as-we-study-through-romans-2-paul-presents-his-readers-with-a-tough-challenge-while-we-all-have-the-tendency-to-focus-on-the-outward-paul-reminds-that-that-god-is-more-interested-in-our-hearts-in-that-light-none-of-us-measure-up-which-makes-the-lords-kind','As we study through Romans 2, Paul presents his readers with a tough challenge. While we all have the tendency to focus on the outward, Paul reminds that that God is more interested in our hearts. In that light, none of us measure up, which makes the Lords kindness all the sweeter.',52,'<p>As we study through Romans 2, Paul presents his readers with a tough challenge. While we all have the tendency to focus on the outward, Paul reminds that that God is more interested in our hearts. In that light, none of us measure up, which makes the Lords kindness all the sweeter.</p>'),
	(19,7716,'this-morning-hans-talks-about-faith-and-how-our-weaknesses-make-our-faith-stronger-when-times-are-tough-we-can-put-our-faith-in-the-lord','This morning, Hans talks about faith, and how our weaknesses make our faith stronger. When times are tough, we can put our faith in the Lord.','this-morning-hans-talks-about-faith-and-how-our-weaknesses-make-our-faith-stronger-when-times-are-tough-we-can-put-our-faith-in-the-lord','This morning, Hans talks about faith, and how our weaknesses make our faith stronger. When times are tough, we can put our faith in the Lord.',26,'<p>This morning, Hans talks about faith, and how our weaknesses make our faith stronger. When times are tough, we can put our faith in the Lord.</p>'),
	(20,7715,'everyone-goes-through-trials-the-question-is-what-do-we-do-when-the-trials-come-jeff-discusses-what-the-bible-says-about-trials-taking-our-thoughts-captive-and-keeping-them-focused-on-jesus-christ','Everyone goes through trials. The question is, what do we do when the trials come? Jeff discusses what the Bible says about trials, taking our thoughts captive, and keeping them focused on Jesus Christ.','everyone-goes-through-trials-the-question-is-what-do-we-do-when-the-trials-come-jeff-discusses-what-the-bible-says-about-trials-taking-our-thoughts-captive-and-keeping-them-focused-on-jesus-christ','Everyone goes through trials. The question is, what do we do when the trials come? Jeff discusses what the Bible says about trials, taking our thoughts captive, and keeping them focused on Jesus Christ.',34,'<p>Everyone goes through trials. The question is, what do we do when the trials come? Jeff discusses what the Bible says about trials, taking our thoughts captive, and keeping them focused on Jesus Christ.</p>'),
