	(24,7710,'tonight-we-continue-on-in-our-messages-to-the-churches-of-revelation-2-our-text-is-the-letter-to-the-church-at-pergamos-and-the-theme-is-derived-from-the-name-of-the-church-literally-objectionable-marriage-we-examine-the-various-applications-of-this-pa','Tonight we continue on in our messages to the churches of Revelation 2. Our text is the letter to the church at Pergamos and the theme is derived from the name of the church - literally objectionable marriage.  We examine the various applications of this particular letter, which is very timely for us today.','tonight-we-continue-on-in-our-messages-to-the-churches-of-revelation-2-our-text-is-the-letter-to-the-church-at-pergamos-and-the-theme-is-derived-from-the-name-of-the-church-literally-objectionable-marriage-we-examine-the-various-applications-of-this-pa','Tonight we continue on in our messages to the churches of Revelation 2. Our text is the letter to the church at Pergamos and the theme is derived from the name of the church - literally objectionable marriage.  We examine the various applications of this particular letter, which is very timely for us today.',55,'<p>Tonight we continue on in our messages to the churches of Revelation 2. Our text is the letter to the church at Pergamos and the theme is derived from the name of the church - literally objectionable marriage.  We examine the various applications of this particular letter, which is very timely for us today.</p>'),
	(25,7711,'we-cover-the-rest-of-romans-1-tonight-paul-explains-not-only-the-qualities-of-the-unrighteous-but-their-lack-of-excuse-as-well-in-light-of-the-great-pains-the-lord-has-taken-to-reveal-himself-to-mankind-this-is-the-groundwork-he-is-laying-for-the-rest-of','We cover the rest of Romans 1 tonight. Paul explains not only the qualities of the unrighteous, but their lack of excuse as well, in light of the great pains the Lord has taken to reveal Himself to mankind. This is the groundwork he is laying for the rest of this powerful book.','we-cover-the-rest-of-romans-1-tonight-paul-explains-not-only-the-qualities-of-the-unrighteous-but-their-lack-of-excuse-as-well-in-light-of-the-great-pains-the-lord-has-taken-to-reveal-himself-to-mankind-this-is-the-groundwork-he-is-laying-for-the-rest-of','We cover the rest of Romans 1 tonight. Paul explains not only the qualities of the unrighteous, but their lack of excuse as well, in light of the great pains the Lord has taken to reveal Himself to mankind. This is the groundwork he is laying for the rest of this powerful book.',53,'<p>We cover the rest of Romans 1 tonight. Paul explains not only the qualities of the unrighteous, but their lack of excuse as well, in light of the great pains the Lord has taken to reveal Himself to mankind. This is the groundwork he is laying for the rest of this powerful book.</p>'),
	(26,7707,'as-we-begin-the-book-of-romans-paul-paints-a-pretty-dark-picture-of-mankind-and-our-depravity-thankfully-that-is-not-the-end-of-the-story-the-black-backdrop-of-our-sin-and-our-need-makes-the-beauty-of-the-lords-love-grace-mercy-and-forgiveness-all-the-bri','As we begin the book of Romans, Paul paints a pretty dark picture of mankind and our depravity. Thankfully, that is not the end of the story. The black backdrop of our sin and our need makes the beauty of the Lords love, grace, mercy and forgiveness all the brighter!','as-we-begin-the-book-of-romans-paul-paints-a-pretty-dark-picture-of-mankind-and-our-depravity-thankfully-that-is-not-the-end-of-the-story-the-black-backdrop-of-our-sin-and-our-need-makes-the-beauty-of-the-lords-love-grace-mercy-and-forgiveness-all-the-bri','As we begin the book of Romans, Paul paints a pretty dark picture of mankind and our depravity. Thankfully, that is not the end of the story. The black backdrop of our sin and our need makes the beauty of the Lords love, grace, mercy and forgiveness all the brighter!',50,'<p>As we begin the book of Romans, Paul paints a pretty dark picture of mankind and our depravity. Thankfully, that is not the end of the story. The black backdrop of our sin and our need makes the beauty of the Lords love, grace, mercy and forgiveness all the brighter!</p>'),
	(27,7704,'as-we-dig-into-the-messages-to-the-churches-we-learn-that-they-will-all-have-multi-level-applications-there-are-truths-to-be-drawn-locally-for-the-greater-church-prophetically-and-personally-with-that-in-mind-we-tackle-this-first-message-to-the-ephesians','As we dig into the messages to the churches, we learn that they will all have multi-level applications. There are truths to be drawn locally, for the greater church, prophetically and personally. With that in mind, we tackle this first message to the Ephesians, which has rich implications for all of us!','as-we-dig-into-the-messages-to-the-churches-we-learn-that-they-will-all-have-multi-level-applications-there-are-truths-to-be-drawn-locally-for-the-greater-church-prophetically-and-personally-with-that-in-mind-we-tackle-this-first-message-to-the-ephesians','As we dig into the messages to the churches, we learn that they will all have multi-level applications. There are truths to be drawn locally, for the greater church, prophetically and personally. With that in mind, we tackle this first message to the Ephesians, which has rich implications for all of us!',52,'<p>As we dig into the messages to the churches, we learn that they will all have multi-level applications. There are truths to be drawn locally, for the greater church, prophetically and personally. With that in mind, we tackle this first message to the Ephesians, which has rich implications for all of us!</p>'),
	(28,7702,'as-herod-listens-to-paul-share-the-gospel-story-with-him-he-is-so-close-to-responding-even-paul-can-sense-it-however-he-has-some-sins-in-his-life-he-refuses-to-let-go-of-in-order-to-fully-embrace-christianity-are-there-things-in-our-lives-that-we-hold-ont','As Herod listens to Paul share the gospel story with him, he is so close to responding. Even Paul can sense it. However, he has some sins in his life he refuses to let go of in order to fully embrace Christianity. Are there things in our lives that we hold onto too tightly that may hinder us from salvation?  Or from the abundant life the Lord has for us?  We can learn a thing or two from the tragic decision Herod made.','as-herod-listens-to-paul-share-the-gospel-story-with-him-he-is-so-close-to-responding-even-paul-can-sense-it-however-he-has-some-sins-in-his-life-he-refuses-to-let-go-of-in-order-to-fully-embrace-christianity-are-there-things-in-our-lives-that-we-hold-ont','As Herod listens to Paul share the gospel story with him, he is so close to responding. Even Paul can sense it. However, he has some sins in his life he refuses to let go of in order to fully embrace Christianity. Are there things in our lives that we hold onto too tightly that may hinder us from salvation?  Or from the abundant life the Lord has for us?  We can learn a thing or two from the tragic decision Herod made.',85,'<p>As Herod listens to Paul share the gospel story with him, he is so close to responding. Even Paul can sense it. However, he has some sins in his life he refuses to let go of in order to fully embrace Christianity. Are there things in our lives that we hold onto too tightly that may hinder us from salvation?  Or from the abundant life the Lord has for us?  We can learn a thing or two from the tragic decision Herod made.</p>'),
