	(33,7692,'are-we-willing-to-die-for-our-faith-not-many-of-us-have-ever-been-in-that-kind-of-scenario-however-there-are-plenty-of-little-deaths-that-should-happen-in-our-lives-how-are-we-doing-in-those-areas-acts-21-gives-us-a-great-jumping-off-point-to-take-a-d','Are we willing to die for our faith?  Not many of us have ever been in that kind of scenario. However, there are plenty of little deaths that should happen in our lives. How are we doing in those areas?  Acts 21 gives us a great jumping-off point to take a deeper look at things we are called to give up for the Lord.','are-we-willing-to-die-for-our-faith-not-many-of-us-have-ever-been-in-that-kind-of-scenario-however-there-are-plenty-of-little-deaths-that-should-happen-in-our-lives-how-are-we-doing-in-those-areas-acts-21-gives-us-a-great-jumping-off-point-to-take-a-d','Are we willing to die for our faith?  Not many of us have ever been in that kind of scenario. However, there are plenty of little deaths that should happen in our lives. How are we doing in those areas?  Acts 21 gives us a great jumping-off point to take a deeper look at things we are called to give up for the Lord.',66,'<p>Are we willing to die for our faith?  Not many of us have ever been in that kind of scenario. However, there are plenty of little deaths that should happen in our lives. How are we doing in those areas?  Acts 21 gives us a great jumping-off point to take a deeper look at things we are called to give up for the Lord.</p>'),
