	(36,7688,'as-paul-ministers-in-the-city-of-ephesus-we-see-a-city-transformed-by-the-teaching-of-the-word-in-addition-to-acts-19-we-also-spend-some-time-in-psalm-119-to-delve-into-the-life-changing-power-of-the-bible','As Paul ministers in the city of Ephesus, we see a city transformed by the teaching of the Word. In addition to Acts 19, we also spend some time in Psalm 119 to delve into the life-changing power of the Bible.','as-paul-ministers-in-the-city-of-ephesus-we-see-a-city-transformed-by-the-teaching-of-the-word-in-addition-to-acts-19-we-also-spend-some-time-in-psalm-119-to-delve-into-the-life-changing-power-of-the-bible','As Paul ministers in the city of Ephesus, we see a city transformed by the teaching of the Word. In addition to Acts 19, we also spend some time in Psalm 119 to delve into the life-changing power of the Bible.',41,'<p>As Paul ministers in the city of Ephesus, we see a city transformed by the teaching of the Word. In addition to Acts 19, we also spend some time in Psalm 119 to delve into the life-changing power of the Bible.</p>'),
	(37,7685,'in-acts-16-paul-and-silas-are-in-a-low-place-beaten-bound-and-imprisoned-yet-we-find-these-two-men-praying-and-worshiping-in-the-dark-of-night-from-a-prison-cell-there-are-priceless-lessons-for-us-to-learn-about-prayer-and-worship-in-the-midst-of-trials-i','In Acts 16, Paul and Silas are in a low place, beaten, bound and imprisoned. Yet we find these two men praying and worshiping in the dark of night, from a prison cell. There are priceless lessons for us to learn about prayer and worship in the midst of trials. If you are feeling stuck, helpless or defeated, this teaching is for you. There is hope and even joy to be found when we cry out to the Lord!','in-acts-16-paul-and-silas-are-in-a-low-place-beaten-bound-and-imprisoned-yet-we-find-these-two-men-praying-and-worshiping-in-the-dark-of-night-from-a-prison-cell-there-are-priceless-lessons-for-us-to-learn-about-prayer-and-worship-in-the-midst-of-trials-i','In Acts 16, Paul and Silas are in a low place, beaten, bound and imprisoned. Yet we find these two men praying and worshiping in the dark of night, from a prison cell. There are priceless lessons for us to learn about prayer and worship in the midst of trials. If you are feeling stuck, helpless or defeated, this teaching is for you. There is hope and even joy to be found when we cry out to the Lord!',79,'<p>In Acts 16, Paul and Silas are in a low place, beaten, bound and imprisoned. Yet we find these two men praying and worshiping in the dark of night, from a prison cell. There are priceless lessons for us to learn about prayer and worship in the midst of trials. If you are feeling stuck, helpless or defeated, this teaching is for you. There is hope and even joy to be found when we cry out to the Lord!</p>'),
	(38,7683,'we-take-a-longer-look-at-the-dispute-that-arose-in-acts-15-and-the-defense-presented-by-the-apostles-the-crux-of-the-matter-was-the-burden-of-law-and-tradition-that-the-jewish-believers-wanted-to-impose-on-the-new-gentile-believers-the-church-comes-to-a','We take a longer look at the dispute that arose in Acts 15, and the defense presented by the apostles. The crux of the matter was the burden of law & tradition that the Jewish believers wanted to impose on the new Gentile believers. The church comes to a decision that brings joy and encouragement, which is what always results when believers extend grace to one another.','we-take-a-longer-look-at-the-dispute-that-arose-in-acts-15-and-the-defense-presented-by-the-apostles-the-crux-of-the-matter-was-the-burden-of-law-and-tradition-that-the-jewish-believers-wanted-to-impose-on-the-new-gentile-believers-the-church-comes-to-a','We take a longer look at the dispute that arose in Acts 15, and the defense presented by the apostles. The crux of the matter was the burden of law & tradition that the Jewish believers wanted to impose on the new Gentile believers. The church comes to a decision that brings joy and encouragement, which is what always results when believers extend grace to one another.',67,'<p>We take a longer look at the dispute that arose in Acts 15, and the defense presented by the apostles. The crux of the matter was the burden of law & tradition that the Jewish believers wanted to impose on the new Gentile believers. The church comes to a decision that brings joy and encouragement, which is what always results when believers extend grace to one another.</p>'),
	(39,7682,'we-are-all-flawed-individuals-the-lord-however-is-full-of-grace-and-forgiveness-through-jesus-christ-we-should-forgive-others-because-of-how-much-god-has-forgiven-us','We are all flawed individuals. The Lord, however, is full of grace and forgiveness through Jesus Christ. We should forgive others because of how much God has forgiven us.','we-are-all-flawed-individuals-the-lord-however-is-full-of-grace-and-forgiveness-through-jesus-christ-we-should-forgive-others-because-of-how-much-god-has-forgiven-us','We are all flawed individuals. The Lord, however, is full of grace and forgiveness through Jesus Christ. We should forgive others because of how much God has forgiven us.',29,'<p>We are all flawed individuals. The Lord, however, is full of grace and forgiveness through Jesus Christ. We should forgive others because of how much God has forgiven us.</p>'),
	(40,7681,'humanity-is-sinful-by-nature-and-deserves-judgment-yet-the-lord-is-so-gracious-to-offer-us-the-inheritance-of-eternal-life-in-heaven-when-we-accept-jesus-christ','Humanity is sinful by nature and deserves judgment. Yet, the Lord is so gracious to offer us the inheritance of eternal life in heaven when we accept Jesus Christ.','humanity-is-sinful-by-nature-and-deserves-judgment-yet-the-lord-is-so-gracious-to-offer-us-the-inheritance-of-eternal-life-in-heaven-when-we-accept-jesus-christ','Humanity is sinful by nature and deserves judgment. Yet, the Lord is so gracious to offer us the inheritance of eternal life in heaven when we accept Jesus Christ.',29,'<p>Humanity is sinful by nature and deserves judgment. Yet, the Lord is so gracious to offer us the inheritance of eternal life in heaven when we accept Jesus Christ.</p>'),
	(41,7680,'acts-15-describes-the-dissension-that-arose-as-the-judaizers-tried-to-saddle-the-new-gentile-believers-with-jewish-traditions-what-role-did-the-law-still-play-in-this-new-faith-we-spend-some-time-studying-joseph-a-wonderful-ot-picture-of-jesus-and-the-ma','Acts 15 describes the dissension that arose as the Judaizers tried to saddle the new Gentile believers with Jewish traditions. What role did the law still play in this new faith? We spend some time studying Joseph, a wonderful OT picture of Jesus, and the many ways he seemed like an unlikely deliverer. Our Savior, in like manner, didnt seem to be what the Jews were expecting in their Messiah, but the work of the salvation was fully accomplished in Him.','acts-15-describes-the-dissension-that-arose-as-the-judaizers-tried-to-saddle-the-new-gentile-believers-with-jewish-traditions-what-role-did-the-law-still-play-in-this-new-faith-we-spend-some-time-studying-joseph-a-wonderful-ot-picture-of-jesus-and-the-ma','Acts 15 describes the dissension that arose as the Judaizers tried to saddle the new Gentile believers with Jewish traditions. What role did the law still play in this new faith? We spend some time studying Joseph, a wonderful OT picture of Jesus, and the many ways he seemed like an unlikely deliverer. Our Savior, in like manner, didnt seem to be what the Jews were expecting in their Messiah, but the work of the salvation was fully accomplished in Him.',81,'<p>Acts 15 describes the dissension that arose as the Judaizers tried to saddle the new Gentile believers with Jewish traditions. What role did the law still play in this new faith? We spend some time studying Joseph, a wonderful OT picture of Jesus, and the many ways he seemed like an unlikely deliverer. Our Savior, in like manner, didnt seem to be what the Jews were expecting in their Messiah, but the work of the salvation was fully accomplished in Him.</p>'),
	(42,7679,'we-cover-the-end-of-pauls-first-missionary-journey-it-wasnt-an-easy-one-as-he-and-barnabas-were-met-with-extreme-reactions-on-the-one-hand-some-gave-them-praise-and-exultation-they-neither-wanted-nor-sought-on-the-other-end-of-the-spectrum-they-faced','We cover the end of Pauls first missionary journey. It wasnt an easy one as he & Barnabas were met with extreme reactions. On the one hand, some gave them praise & exultation they neither wanted, nor sought. On the other end of the spectrum, they faced fierce opposition and even stoning. In all of this, the gospel was taught faithfully and brought about much fruit.','we-cover-the-end-of-pauls-first-missionary-journey-it-wasnt-an-easy-one-as-he-and-barnabas-were-met-with-extreme-reactions-on-the-one-hand-some-gave-them-praise-and-exultation-they-neither-wanted-nor-sought-on-the-other-end-of-the-spectrum-they-faced','We cover the end of Pauls first missionary journey. It wasnt an easy one as he & Barnabas were met with extreme reactions. On the one hand, some gave them praise & exultation they neither wanted, nor sought. On the other end of the spectrum, they faced fierce opposition and even stoning. In all of this, the gospel was taught faithfully and brought about much fruit.',66,'<p>We cover the end of Pauls first missionary journey. It wasnt an easy one as he & Barnabas were met with extreme reactions. On the one hand, some gave them praise & exultation they neither wanted, nor sought. On the other end of the spectrum, they faced fierce opposition and even stoning. In all of this, the gospel was taught faithfully and brought about much fruit.</p>'),
	(43,7678,'bobby-belt-filled-in-for-pastor-brett-this-morning-and-shared-a-teaching-about-david-and-the-powerful-hope-he-had-in-the-lord-we-too-can-find-the-strength-that-david-did-as-we-fix-our-eyes-on-the-author-and-perfecter-of-our-faith','Bobby Belt filled in for Pastor Brett this morning and shared a teaching about David and the powerful hope he had in the Lord. We, too, can find the strength that David did as we fix our eyes on the Author and Perfecter of our faith.','bobby-belt-filled-in-for-pastor-brett-this-morning-and-shared-a-teaching-about-david-and-the-powerful-hope-he-had-in-the-lord-we-too-can-find-the-strength-that-david-did-as-we-fix-our-eyes-on-the-author-and-perfecter-of-our-faith','Bobby Belt filled in for Pastor Brett this morning and shared a teaching about David and the powerful hope he had in the Lord. We, too, can find the strength that David did as we fix our eyes on the Author and Perfecter of our faith.',46,'<p>Bobby Belt filled in for Pastor Brett this morning and shared a teaching about David and the powerful hope he had in the Lord. We, too, can find the strength that David did as we fix our eyes on the Author and Perfecter of our faith.</p>'),
