	(51,7663,'when-division-creeps-into-the-early-church-the-apostles-respond-by-addressing-the-practical-needs-of-the-body-of-believers-the-roles-of-elders-and-deacons-begin-to-take-shape-and-provide-a-great-blueprint-for-churches-today','When division creeps into the early church, the apostles respond by addressing the practical needs of the Body of believers. The roles of elders and deacons begin to take shape and provide a great blueprint for churches today.','when-division-creeps-into-the-early-church-the-apostles-respond-by-addressing-the-practical-needs-of-the-body-of-believers-the-roles-of-elders-and-deacons-begin-to-take-shape-and-provide-a-great-blueprint-for-churches-today','When division creeps into the early church, the apostles respond by addressing the practical needs of the Body of believers. The roles of elders and deacons begin to take shape and provide a great blueprint for churches today.',38,'<p>When division creeps into the early church, the apostles respond by addressing the practical needs of the Body of believers. The roles of elders and deacons begin to take shape and provide a great blueprint for churches today.</p>'),
	(52,7662,'when-the-word-of-god-is-being-challenged-even-perverted-how-are-we-as-christians-to-respond-stephen-filled-with-the-spirit-provides-us-a-perfect-example-as-he-addressed-his-attackers-with-strong-faith-a-solid-grasp-of-scripture-and-his-glowing-countenan','When the Word of God is being challenged, even perverted, how are we as Christians to respond?  Stephen, filled with the Spirit, provides us a perfect example as he addressed his attackers with strong faith, a solid grasp of Scripture and his glowing countenance.','when-the-word-of-god-is-being-challenged-even-perverted-how-are-we-as-christians-to-respond-stephen-filled-with-the-spirit-provides-us-a-perfect-example-as-he-addressed-his-attackers-with-strong-faith-a-solid-grasp-of-scripture-and-his-glowing-countenan','When the Word of God is being challenged, even perverted, how are we as Christians to respond?  Stephen, filled with the Spirit, provides us a perfect example as he addressed his attackers with strong faith, a solid grasp of Scripture and his glowing countenance.',45,'<p>When the Word of God is being challenged, even perverted, how are we as Christians to respond?  Stephen, filled with the Spirit, provides us a perfect example as he addressed his attackers with strong faith, a solid grasp of Scripture and his glowing countenance.</p>'),
	(53,7661,'while-it-was-evident-to-all-that-the-lord-was-doing-a-mighty-work-in-this-group-of-new-believers-some-still-found-a-way-to-discount-his-incredible-power-in-their-jealousy-the-religious-leaders-were-determined-to-silence-these-new-christ-followers-rather-t','While it was evident to all that the Lord was doing a mighty work in this group of new believers, some still found a way to discount His incredible power. In their jealousy, the religious leaders were determined to silence these new Christ-followers. Rather than shrinking back in fear, however, the apostles became all the more emboldened to teach and proclaim the Good News about Jesus.','while-it-was-evident-to-all-that-the-lord-was-doing-a-mighty-work-in-this-group-of-new-believers-some-still-found-a-way-to-discount-his-incredible-power-in-their-jealousy-the-religious-leaders-were-determined-to-silence-these-new-christ-followers-rather-t','While it was evident to all that the Lord was doing a mighty work in this group of new believers, some still found a way to discount His incredible power. In their jealousy, the religious leaders were determined to silence these new Christ-followers. Rather than shrinking back in fear, however, the apostles became all the more emboldened to teach and proclaim the Good News about Jesus.',66,'<p>While it was evident to all that the Lord was doing a mighty work in this group of new believers, some still found a way to discount His incredible power. In their jealousy, the religious leaders were determined to silence these new Christ-followers. Rather than shrinking back in fear, however, the apostles became all the more emboldened to teach and proclaim the Good News about Jesus.</p>'),
