	(525,6899,'we-take-a-look-at-the-initial-coming-of-the-holy-spirit-on-the-day-of-pentecost-and-what-it-meant-for-those-early-church-believers-as-well-as-what-it-means-for-us-today','We take a look at the initial coming of the Holy Spirit on the Day of Pentecost and what it meant for those early church believers, as well as what it means for us today.','we-take-a-look-at-the-initial-coming-of-the-holy-spirit-on-the-day-of-pentecost-and-what-it-meant-for-those-early-church-believers-as-well-as-what-it-means-for-us-today','We take a look at the initial coming of the Holy Spirit on the Day of Pentecost and what it meant for those early church believers, as well as what it means for us today.',35,'<p>We take a look at the initial coming of the Holy Spirit on the Day of Pentecost and what it meant for those early church believers, as well as what it means for us today.</p>'),
	(526,6894,'martin-luther-said-that-in-order-to-fully-understand-the-new-testament-it-was-necessary-to-understand-the-prepositions-in-this-study-we-look-at-their-significance-in-relation-to-the-holy-spirits-role-in-our-lives-with-in-and-upon-us','Martin Luther said that in order to fully understand the New Testament, it was necessary to understand the prepositions. In this study, we look at their significance in relation to the Holy Spirits role in our lives - with, in and upon us','martin-luther-said-that-in-order-to-fully-understand-the-new-testament-it-was-necessary-to-understand-the-prepositions-in-this-study-we-look-at-their-significance-in-relation-to-the-holy-spirits-role-in-our-lives-with-in-and-upon-us','Martin Luther said that in order to fully understand the New Testament, it was necessary to understand the prepositions. In this study, we look at their significance in relation to the Holy Spirits role in our lives - with, in and upon us',43,'<p>Martin Luther said that in order to fully understand the New Testament, it was necessary to understand the prepositions. In this study, we look at their significance in relation to the Holy Spirits role in our lives - with, in and upon us</p>'),
	(527,6891,'the-role-of-the-holy-spirit-is-often-misunderstood-but-what-does-the-bible-say-about-his-place-in-the-life-of-the-believer-or-of-the-church-this-message-lays-a-foundation-for-us-which-allows-us-to-accurately-understand-the-work-of-the-spirit-as-we-begin','The role of the Holy Spirit is often misunderstood. But what does the Bible say about His place in the life of the believer, or of the church?  This message lays a foundation for us which allows us to accurately understand the work of the Spirit as we begin this series.','the-role-of-the-holy-spirit-is-often-misunderstood-but-what-does-the-bible-say-about-his-place-in-the-life-of-the-believer-or-of-the-church-this-message-lays-a-foundation-for-us-which-allows-us-to-accurately-understand-the-work-of-the-spirit-as-we-begin','The role of the Holy Spirit is often misunderstood. But what does the Bible say about His place in the life of the believer, or of the church?  This message lays a foundation for us which allows us to accurately understand the work of the Spirit as we begin this series.',52,'<p>The role of the Holy Spirit is often misunderstood. But what does the Bible say about His place in the life of the believer, or of the church?  This message lays a foundation for us which allows us to accurately understand the work of the Spirit as we begin this series.</p>'),
	(528,6904,'this-study-provides-us-with-insight-into-the-spirits-role-in-the-trinity-from-creation-to-rich-symbolism-in-the-old-testament-we-can-learn-so-much-about-gods-character-as-we-study-the-unique-personality-of-the-spirit','This study provides us with insight into the Spirits role in the trinity. From creation, to rich symbolism in the Old Testament, we can learn so much about Gods character as we study the unique personality of the Spirit.','this-study-provides-us-with-insight-into-the-spirits-role-in-the-trinity-from-creation-to-rich-symbolism-in-the-old-testament-we-can-learn-so-much-about-gods-character-as-we-study-the-unique-personality-of-the-spirit','This study provides us with insight into the Spirits role in the trinity. From creation, to rich symbolism in the Old Testament, we can learn so much about Gods character as we study the unique personality of the Spirit.',39,'<p>This study provides us with insight into the Spirits role in the trinity. From creation, to rich symbolism in the Old Testament, we can learn so much about Gods character as we study the unique personality of the Spirit.</p>'),
