	(534,7659,'unable-to-deny-the-miracle-of-the-lame-mans-healing-the-religious-leaders-attack-peter-and-john-by-the-holy-spirits-power-peter-boldly-defends-the-name-of-jesus-in-spite-of-the-opposition-the-church-is-strengthened-as-the-believers-remain-prayerful-stea','Unable to deny the miracle of the lame mans healing, the religious leaders attack Peter & John. By the Holy Spirits power, Peter boldly defends the name of Jesus. In spite of the opposition, the church is strengthened as the believers remain prayerful, steadfast & united.','unable-to-deny-the-miracle-of-the-lame-mans-healing-the-religious-leaders-attack-peter-and-john-by-the-holy-spirits-power-peter-boldly-defends-the-name-of-jesus-in-spite-of-the-opposition-the-church-is-strengthened-as-the-believers-remain-prayerful-stea','Unable to deny the miracle of the lame mans healing, the religious leaders attack Peter & John. By the Holy Spirits power, Peter boldly defends the name of Jesus. In spite of the opposition, the church is strengthened as the believers remain prayerful, steadfast & united.',46,'<p>Unable to deny the miracle of the lame mans healing, the religious leaders attack Peter & John. By the Holy Spirits power, Peter boldly defends the name of Jesus. In spite of the opposition, the church is strengthened as the believers remain prayerful, steadfast & united.</p>'),
	(535,7664,'stephens-profound-sermon-begins-with-a-brief-history-of-israel-this-sundays-teaching-allows-us-a-chance-to-examine-the-history-of-gods-chosen-people-from-abraham-to-present-day-israel-gods-faithfulness-to-his-promises-are-evident-as-we-take-time-to-consid','Stephens profound sermon begins with a brief history of Israel. This Sundays teaching allows us a chance to examine the history of Gods chosen people from Abraham to present-day Israel. Gods faithfulness to His promises are evident as we take time to consider the miraculous preservation of the Jewish people throughout the course of human history and the incredible plans He has for their future.','stephens-profound-sermon-begins-with-a-brief-history-of-israel-this-sundays-teaching-allows-us-a-chance-to-examine-the-history-of-gods-chosen-people-from-abraham-to-present-day-israel-gods-faithfulness-to-his-promises-are-evident-as-we-take-time-to-consid','Stephens profound sermon begins with a brief history of Israel. This Sundays teaching allows us a chance to examine the history of Gods chosen people from Abraham to present-day Israel. Gods faithfulness to His promises are evident as we take time to consider the miraculous preservation of the Jewish people throughout the course of human history and the incredible plans He has for their future.',65,'<p>Stephens profound sermon begins with a brief history of Israel. This Sundays teaching allows us a chance to examine the history of Gods chosen people from Abraham to present-day Israel. Gods faithfulness to His promises are evident as we take time to consider the miraculous preservation of the Jewish people throughout the course of human history and the incredible plans He has for their future.</p>'),
	(536,7665,'as-we-take-a-look-at-the-first-portion-of-stephens-sermon-we-see-him-delve-into-the-history-of-the-jewish-people-and-their-frequent-disobedience-however-he-also-takes-time-to-highlight-the-many-ways-the-lord-showed-himself-faithful-to-his-people-in-the-mi','As we take a look at the first portion of Stephens sermon, we see him delve into the history of the Jewish people and their frequent disobedience. However, he also takes time to highlight the many ways the Lord showed Himself faithful to His people in the midst of their rebellion.','as-we-take-a-look-at-the-first-portion-of-stephens-sermon-we-see-him-delve-into-the-history-of-the-jewish-people-and-their-frequent-disobedience-however-he-also-takes-time-to-highlight-the-many-ways-the-lord-showed-himself-faithful-to-his-people-in-the-mi','As we take a look at the first portion of Stephens sermon, we see him delve into the history of the Jewish people and their frequent disobedience. However, he also takes time to highlight the many ways the Lord showed Himself faithful to His people in the midst of their rebellion.',51,'<p>As we take a look at the first portion of Stephens sermon, we see him delve into the history of the Jewish people and their frequent disobedience. However, he also takes time to highlight the many ways the Lord showed Himself faithful to His people in the midst of their rebellion.</p>'),
	(537,7667,'the-conclusion-of-this-chapter-is-packed-with-important-truths-the-conclusion-of-stephens-spirit-filled-sermon-his-death-at-the-hands-of-the-sannhedrin-and-the-profound-impact-his-death-had-on-the-church-we-are-also-introduced-to-a-young-man-named-saul','The conclusion of this chapter is packed with important truths - the conclusion of Stephens Spirit-filled sermon, his death at the hands of the Sannhedrin and the profound impact his death had on the church. We are also introduced to a young man named Saul, who will have a central role to play in the continuing story of the church and the spreading of the Gospel.','the-conclusion-of-this-chapter-is-packed-with-important-truths-the-conclusion-of-stephens-spirit-filled-sermon-his-death-at-the-hands-of-the-sannhedrin-and-the-profound-impact-his-death-had-on-the-church-we-are-also-introduced-to-a-young-man-named-saul','The conclusion of this chapter is packed with important truths - the conclusion of Stephens Spirit-filled sermon, his death at the hands of the Sannhedrin and the profound impact his death had on the church. We are also introduced to a young man named Saul, who will have a central role to play in the continuing story of the church and the spreading of the Gospel.',66,'<p>The conclusion of this chapter is packed with important truths - the conclusion of Stephens Spirit-filled sermon, his death at the hands of the Sannhedrin and the profound impact his death had on the church. We are also introduced to a young man named Saul, who will have a central role to play in the continuing story of the church and the spreading of the Gospel.</p>'),
	(538,7669,'this-chapter-gives-us-a-closer-look-at-four-main-characters-and-what-we-can-learn-from-each-of-them-saul-the-zealous-persecutor-philip-the-faithful-evangelist-simon-the-clever-deceiver-and-the-ethiopian-man-a-concerned-seeker','This chapter gives us a closer look at four main characters and what we can learn from each of them: Saul - the zealous persecutor, Philip - the faithful evangelist, Simon - the clever deceiver and the Ethiopian man - a concerned seeker.','this-chapter-gives-us-a-closer-look-at-four-main-characters-and-what-we-can-learn-from-each-of-them-saul-the-zealous-persecutor-philip-the-faithful-evangelist-simon-the-clever-deceiver-and-the-ethiopian-man-a-concerned-seeker','This chapter gives us a closer look at four main characters and what we can learn from each of them: Saul - the zealous persecutor, Philip - the faithful evangelist, Simon - the clever deceiver and the Ethiopian man - a concerned seeker.',43,'<p>This chapter gives us a closer look at four main characters and what we can learn from each of them: Saul - the zealous persecutor, Philip - the faithful evangelist, Simon - the clever deceiver and the Ethiopian man - a concerned seeker.</p>'),
	(539,7674,'the-story-of-peters-vision-is-told-for-the-third-time-in-two-chapters-clearly-the-lord-is-emphasizing-the-importance-of-his-declaration-to-peter-the-themes-in-this-passage-hold-important-truths-for-us-today-about-sin-forgiveness-and-the-lords-incredible-p','The story of Peters vision is told for the third time in two chapters. Clearly, the Lord is emphasizing the importance of His declaration to Peter. The themes in this passage hold important truths for us today about sin, forgiveness and the Lords incredible power to make us truly clean.','the-story-of-peters-vision-is-told-for-the-third-time-in-two-chapters-clearly-the-lord-is-emphasizing-the-importance-of-his-declaration-to-peter-the-themes-in-this-passage-hold-important-truths-for-us-today-about-sin-forgiveness-and-the-lords-incredible-p','The story of Peters vision is told for the third time in two chapters. Clearly, the Lord is emphasizing the importance of His declaration to Peter. The themes in this passage hold important truths for us today about sin, forgiveness and the Lords incredible power to make us truly clean.',50,'<p>The story of Peters vision is told for the third time in two chapters. Clearly, the Lord is emphasizing the importance of His declaration to Peter. The themes in this passage hold important truths for us today about sin, forgiveness and the Lords incredible power to make us truly clean.</p>'),
	(540,7676,'this-chapter-opens-as-the-holy-spirit-selects-barnabus-and-paul-to-be-sent-out-by-the-church-this-begins-pauls-first-missionary-journey-as-they-share-the-truth-of-the-gospel-they-are-greeted-with-very-different-responses-they-are-opposed-by-a-false-prophe','This chapter opens as the Holy Spirit selects Barnabus and Paul to be sent out by the church. This begins Pauls first missionary journey. As they share the truth of the gospel, they are greeted with very different responses. They are opposed by a false prophet, and run out of town  jealous Jewish leaders. However, when the Gentiles heard this [the Gospel], they were glad and honored the word of the Lord...','this-chapter-opens-as-the-holy-spirit-selects-barnabus-and-paul-to-be-sent-out-by-the-church-this-begins-pauls-first-missionary-journey-as-they-share-the-truth-of-the-gospel-they-are-greeted-with-very-different-responses-they-are-opposed-by-a-false-prophe','This chapter opens as the Holy Spirit selects Barnabus and Paul to be sent out by the church. This begins Pauls first missionary journey. As they share the truth of the gospel, they are greeted with very different responses. They are opposed by a false prophet, and run out of town  jealous Jewish leaders. However, when the Gentiles heard this [the Gospel], they were glad and honored the word of the Lord...',73,'<p>This chapter opens as the Holy Spirit selects Barnabus and Paul to be sent out by the church. This begins Pauls first missionary journey. As they share the truth of the gospel, they are greeted with very different responses. They are opposed by a false prophet, and run out of town  jealous Jewish leaders. However, when the Gentiles heard this [the Gospel], they were glad and honored the word of the Lord...</p>'),
	(541,7677,'what-does-forgiveness-really-mean-for-us-as-believers-this-morning-we-look-to-david-the-man-after-gods-own-heart-to-see-what-he-learned-about-sin-and-forgiveness-while-sin-results-in-death-and-decay-jesus-death-and-resurrection-represents-a-great-resc','What does forgiveness really mean for us as believers?  This morning, we look to David, the man after Gods own heart, to see what he learned about sin and forgiveness. While sin results in death and decay, Jesus death & resurrection represents a great rescue for us. Todays teaching is a wonderful reminder of the blessings receive because of Jesus triumphant work on the cross.','what-does-forgiveness-really-mean-for-us-as-believers-this-morning-we-look-to-david-the-man-after-gods-own-heart-to-see-what-he-learned-about-sin-and-forgiveness-while-sin-results-in-death-and-decay-jesus-death-and-resurrection-represents-a-great-resc','What does forgiveness really mean for us as believers?  This morning, we look to David, the man after Gods own heart, to see what he learned about sin and forgiveness. While sin results in death and decay, Jesus death & resurrection represents a great rescue for us. Todays teaching is a wonderful reminder of the blessings receive because of Jesus triumphant work on the cross.',66,'<p>What does forgiveness really mean for us as believers?  This morning, we look to David, the man after Gods own heart, to see what he learned about sin and forgiveness. While sin results in death and decay, Jesus death & resurrection represents a great rescue for us. Todays teaching is a wonderful reminder of the blessings receive because of Jesus triumphant work on the cross.</p>'),
	(542,7684,'acts-16-is-the-beginning-of-pauls-second-missionary-journey-in-this-study-we-learn-about-the-circuitous-route-they-took-to-finally-get-started-in-philippi-and-the-foundation-of-that-church-that-became-so-dear-to-paul-specifically-we-look-at-two-women-ly','Acts 16 is the beginning of Pauls second missionary journey. In this study, we learn about the circuitous route they took to finally get started in Philippi and the foundation of that church that became so dear to Paul. Specifically, we look at two women - Lydia and the fortune-telling slave girl. The comparison and contrasts between these two can offer us great insights with regard to the church today.','acts-16-is-the-beginning-of-pauls-second-missionary-journey-in-this-study-we-learn-about-the-circuitous-route-they-took-to-finally-get-started-in-philippi-and-the-foundation-of-that-church-that-became-so-dear-to-paul-specifically-we-look-at-two-women-ly','Acts 16 is the beginning of Pauls second missionary journey. In this study, we learn about the circuitous route they took to finally get started in Philippi and the foundation of that church that became so dear to Paul. Specifically, we look at two women - Lydia and the fortune-telling slave girl. The comparison and contrasts between these two can offer us great insights with regard to the church today.',70,'<p>Acts 16 is the beginning of Pauls second missionary journey. In this study, we learn about the circuitous route they took to finally get started in Philippi and the foundation of that church that became so dear to Paul. Specifically, we look at two women - Lydia and the fortune-telling slave girl. The comparison and contrasts between these two can offer us great insights with regard to the church today.</p>'),
	(543,7686,'in-acts-17-paul-visits-three-different-cities-thessalonica-berea-and-athens-this-mornings-teaching-is-a-study-of-how-the-various-people-respond-to-the-gospel-whether-you-are-hearing-the-gospel-or-sharing-the-gospel-this-is-a-significant-passage-of-scrip','In Acts 17, Paul visits three different cities - Thessalonica, Berea and Athens. This mornings teaching is a study of how the various people respond to the Gospel. Whether you are hearing the Gospel, or sharing the Gospel, this is a significant passage of scripture to consider.','in-acts-17-paul-visits-three-different-cities-thessalonica-berea-and-athens-this-mornings-teaching-is-a-study-of-how-the-various-people-respond-to-the-gospel-whether-you-are-hearing-the-gospel-or-sharing-the-gospel-this-is-a-significant-passage-of-scrip','In Acts 17, Paul visits three different cities - Thessalonica, Berea and Athens. This mornings teaching is a study of how the various people respond to the Gospel. Whether you are hearing the Gospel, or sharing the Gospel, this is a significant passage of scripture to consider.',47,'<p>In Acts 17, Paul visits three different cities - Thessalonica, Berea and Athens. This mornings teaching is a study of how the various people respond to the Gospel. Whether you are hearing the Gospel, or sharing the Gospel, this is a significant passage of scripture to consider.</p>'),
	(544,7687,'in-tonights-through-the-bible-study-we-learn-about-the-beginnings-of-the-corinthian-church-the-time-paul-spent-ministering-there-and-the-couple-priscilla-and-aquila-who-would-be-important-partners-in-his-life-and-ministry','In tonights through-the-Bible study, we learn about the beginnings of the Corinthian church, the time Paul spent ministering there, and the couple (Priscilla & Aquila) who would be important partners in his life & ministry.','in-tonights-through-the-bible-study-we-learn-about-the-beginnings-of-the-corinthian-church-the-time-paul-spent-ministering-there-and-the-couple-priscilla-and-aquila-who-would-be-important-partners-in-his-life-and-ministry','In tonights through-the-Bible study, we learn about the beginnings of the Corinthian church, the time Paul spent ministering there, and the couple (Priscilla & Aquila) who would be important partners in his life & ministry.',35,'<p>In tonights through-the-Bible study, we learn about the beginnings of the Corinthian church, the time Paul spent ministering there, and the couple (Priscilla & Aquila) who would be important partners in his life & ministry.</p>'),
	(545,7689,'acts-19-teaches-us-more-about-pauls-ministry-to-the-city-of-ephesus-it-was-a-unique-time-as-the-lord-worked-mightily-in-such-a-spiritually-dark-area-paul-encountered-false-prophets-sorcery-witchcraft-and-even-rioting-but-the-holy-spirit-moved-powerfully-i','Acts 19 teaches us more about Pauls ministry to the city of Ephesus. It was a unique time as the Lord worked mightily in such a spiritually dark area. Paul encountered false prophets, sorcery, witchcraft and even rioting. But the Holy Spirit moved powerfully in the lives of the new believers and the entire region of Asia was reached with the Good News, so mightily grew the Word of God and prevailed.','acts-19-teaches-us-more-about-pauls-ministry-to-the-city-of-ephesus-it-was-a-unique-time-as-the-lord-worked-mightily-in-such-a-spiritually-dark-area-paul-encountered-false-prophets-sorcery-witchcraft-and-even-rioting-but-the-holy-spirit-moved-powerfully-i','Acts 19 teaches us more about Pauls ministry to the city of Ephesus. It was a unique time as the Lord worked mightily in such a spiritually dark area. Paul encountered false prophets, sorcery, witchcraft and even rioting. But the Holy Spirit moved powerfully in the lives of the new believers and the entire region of Asia was reached with the Good News, so mightily grew the Word of God and prevailed.',72,'<p>Acts 19 teaches us more about Pauls ministry to the city of Ephesus. It was a unique time as the Lord worked mightily in such a spiritually dark area. Paul encountered false prophets, sorcery, witchcraft and even rioting. But the Holy Spirit moved powerfully in the lives of the new believers and the entire region of Asia was reached with the Good News, so mightily grew the Word of God and prevailed.</p>'),
	(546,7695,'revelation-is-the-only-book-that-essentially-says-read-me-there-is-a-special-promise-for-those-who-read-this-book-in-tonights-study-we-cover-a-whole-spectrum-of-topics-about-the-book-of-revelation-including-the-tribulation-the-spirit-of-prophecy-the-imp','Revelation is the only book that essentially says, Read me!  There is a special promise for those who read this book. In tonights study, we cover a whole spectrum of topics about the book of Revelation, including the tribulation, the spirit of prophecy, the importance of the Bible, the trinity, names of Jesus, the heptatic nature of the Word and much more!','revelation-is-the-only-book-that-essentially-says-read-me-there-is-a-special-promise-for-those-who-read-this-book-in-tonights-study-we-cover-a-whole-spectrum-of-topics-about-the-book-of-revelation-including-the-tribulation-the-spirit-of-prophecy-the-imp','Revelation is the only book that essentially says, Read me!  There is a special promise for those who read this book. In tonights study, we cover a whole spectrum of topics about the book of Revelation, including the tribulation, the spirit of prophecy, the importance of the Bible, the trinity, names of Jesus, the heptatic nature of the Word and much more!',63,'<p>Revelation is the only book that essentially says, Read me!  There is a special promise for those who read this book. In tonights study, we cover a whole spectrum of topics about the book of Revelation, including the tribulation, the spirit of prophecy, the importance of the Bible, the trinity, names of Jesus, the heptatic nature of the Word and much more!</p>'),
	(547,7696,'most-of-us-have-plenty-for-which-to-be-thankful-why-is-it-then-that-we-can-so-easily-be-grouchy-in-our-passage-in-acts-the-lord-tells-paul-to-be-of-good-cheer-this-morning-we-take-some-time-to-consider-the-many-things-jesus-has-done-that-should-result','Most of us have plenty for which to be thankful. Why is it, then, that we can so easily be grouchy?  In our passage in Acts, the Lord tells Paul to, Be of good cheer.  This morning, we take some time to consider the many things Jesus has done that should result in good cheer for us as well!','most-of-us-have-plenty-for-which-to-be-thankful-why-is-it-then-that-we-can-so-easily-be-grouchy-in-our-passage-in-acts-the-lord-tells-paul-to-be-of-good-cheer-this-morning-we-take-some-time-to-consider-the-many-things-jesus-has-done-that-should-result','Most of us have plenty for which to be thankful. Why is it, then, that we can so easily be grouchy?  In our passage in Acts, the Lord tells Paul to, Be of good cheer.  This morning, we take some time to consider the many things Jesus has done that should result in good cheer for us as well!',61,'<p>Most of us have plenty for which to be thankful. Why is it, then, that we can so easily be grouchy?  In our passage in Acts, the Lord tells Paul to, Be of good cheer.  This morning, we take some time to consider the many things Jesus has done that should result in good cheer for us as well!</p>'),
	(548,7697,'pauls-story-continues-as-he-faces-an-inquiry-before-the-sanhedrin-a-dishonest-high-priest-and-a-plot-against-his-life-in-the-midst-of-all-of-this-the-lord-appears-to-encourage-paul-personally-reminding-him-that-his-purposes-will-be-fulfilled-he-uses-pauls','Pauls story continues as he faces an inquiry before the Sanhedrin, a dishonest high priest and a plot against his life. In the midst of all of this, the Lord appears to encourage Paul personally, reminding him that His purposes will be fulfilled. He uses Pauls young nephew to preserve his life and see him to his next destination.','pauls-story-continues-as-he-faces-an-inquiry-before-the-sanhedrin-a-dishonest-high-priest-and-a-plot-against-his-life-in-the-midst-of-all-of-this-the-lord-appears-to-encourage-paul-personally-reminding-him-that-his-purposes-will-be-fulfilled-he-uses-pauls','Pauls story continues as he faces an inquiry before the Sanhedrin, a dishonest high priest and a plot against his life. In the midst of all of this, the Lord appears to encourage Paul personally, reminding him that His purposes will be fulfilled. He uses Pauls young nephew to preserve his life and see him to his next destination.',59,'<p>Pauls story continues as he faces an inquiry before the Sanhedrin, a dishonest high priest and a plot against his life. In the midst of all of this, the Lord appears to encourage Paul personally, reminding him that His purposes will be fulfilled. He uses Pauls young nephew to preserve his life and see him to his next destination.</p>'),
	(549,7698,'paul-is-summoned-to-speak-to-felix-and-his-wife-drusilla-felix-is-shaken-by-pauls-words-yet-rather-than-respond-felix-sends-him-away-todays-teaching-is-a-deeper-look-at-what-paul-shared-regarding-righteousness-temperance-and-the-judgment-to-come-hopefully','Paul is summoned to speak to Felix and his wife, Drusilla. Felix is shaken by Pauls words. Yet, rather than respond, Felix sends him away. Todays teaching is a deeper look at what Paul shared regarding righteousness, temperance and the judgment to come. Hopefully we will take the time to consider Pauls teaching, and respond prayerfully and thoughtfully, unlike this foolish pair.','paul-is-summoned-to-speak-to-felix-and-his-wife-drusilla-felix-is-shaken-by-pauls-words-yet-rather-than-respond-felix-sends-him-away-todays-teaching-is-a-deeper-look-at-what-paul-shared-regarding-righteousness-temperance-and-the-judgment-to-come-hopefully','Paul is summoned to speak to Felix and his wife, Drusilla. Felix is shaken by Pauls words. Yet, rather than respond, Felix sends him away. Todays teaching is a deeper look at what Paul shared regarding righteousness, temperance and the judgment to come. Hopefully we will take the time to consider Pauls teaching, and respond prayerfully and thoughtfully, unlike this foolish pair.',62,'<p>Paul is summoned to speak to Felix and his wife, Drusilla. Felix is shaken by Pauls words. Yet, rather than respond, Felix sends him away. Todays teaching is a deeper look at what Paul shared regarding righteousness, temperance and the judgment to come. Hopefully we will take the time to consider Pauls teaching, and respond prayerfully and thoughtfully, unlike this foolish pair.</p>'),
	(550,7700,'in-revelation-1-19-jesus-lays-down-the-outline-for-the-book-of-revelation-for-john-write-the-things-which-thou-hast-seen-and-the-things-which-are-and-the-things-which-shall-be-hereafter-tonight-pastor-brett-breaks-down-the-various-eschatological-views-a','In Revelation 1:19, Jesus lays down the outline for the book of Revelation for John: Write the things which thou hast seen, and the things which are, and the things which shall be hereafter.  Tonight, Pastor Brett breaks down the various eschatological views as a foundation for our study of this powerful book. It is a great overview of end times theology.','in-revelation-1-19-jesus-lays-down-the-outline-for-the-book-of-revelation-for-john-write-the-things-which-thou-hast-seen-and-the-things-which-are-and-the-things-which-shall-be-hereafter-tonight-pastor-brett-breaks-down-the-various-eschatological-views-a','In Revelation 1:19, Jesus lays down the outline for the book of Revelation for John: Write the things which thou hast seen, and the things which are, and the things which shall be hereafter.  Tonight, Pastor Brett breaks down the various eschatological views as a foundation for our study of this powerful book. It is a great overview of end times theology.',63,'<p>In Revelation 1:19, Jesus lays down the outline for the book of Revelation for John: Write the things which thou hast seen, and the things which are, and the things which shall be hereafter.  Tonight, Pastor Brett breaks down the various eschatological views as a foundation for our study of this powerful book. It is a great overview of end times theology.</p>'),
	(551,7703,'tonights-teaching-is-a-deeper-look-at-pauls-testimony-before-herod-agrippa-as-we-examine-this-rich-text-we-see-pauls-amazing-testimony-and-the-special-calling-the-lord-placed-on-his-life','Tonights teaching is a deeper look at Pauls testimony before Herod Agrippa. As we examine this rich text, we see Pauls amazing testimony, and the special calling the Lord placed on his life.','tonights-teaching-is-a-deeper-look-at-pauls-testimony-before-herod-agrippa-as-we-examine-this-rich-text-we-see-pauls-amazing-testimony-and-the-special-calling-the-lord-placed-on-his-life','Tonights teaching is a deeper look at Pauls testimony before Herod Agrippa. As we examine this rich text, we see Pauls amazing testimony, and the special calling the Lord placed on his life.',33,'<p>Tonights teaching is a deeper look at Pauls testimony before Herod Agrippa. As we examine this rich text, we see Pauls amazing testimony, and the special calling the Lord placed on his life.</p>'),
	(552,7705,'we-wrap-up-the-book-of-acts-and-to-some-degree-the-ministry-of-paul-he-had-a-clear-understanding-that-while-it-is-appointed-once-for-man-to-die-he-was-going-to-live-his-life-with-abandon-until-that-day-came-his-life-and-his-ministry-were-marked-with-a-sen','We wrap up the book of Acts and, to some degree, the ministry of Paul. He had a clear understanding that while, it is appointed once for man to die, he was going to live his life with abandon until that day came. His life and his ministry were marked with a sense of abandon; he gave himself fully to the Lord and was used in mighty ways. There is a lot for us to glean today as we look at the conclusion of this apostles story.','we-wrap-up-the-book-of-acts-and-to-some-degree-the-ministry-of-paul-he-had-a-clear-understanding-that-while-it-is-appointed-once-for-man-to-die-he-was-going-to-live-his-life-with-abandon-until-that-day-came-his-life-and-his-ministry-were-marked-with-a-sen','We wrap up the book of Acts and, to some degree, the ministry of Paul. He had a clear understanding that while, it is appointed once for man to die, he was going to live his life with abandon until that day came. His life and his ministry were marked with a sense of abandon; he gave himself fully to the Lord and was used in mighty ways. There is a lot for us to glean today as we look at the conclusion of this apostles story.',87,'<p>We wrap up the book of Acts and, to some degree, the ministry of Paul. He had a clear understanding that while, it is appointed once for man to die, he was going to live his life with abandon until that day came. His life and his ministry were marked with a sense of abandon; he gave himself fully to the Lord and was used in mighty ways. There is a lot for us to glean today as we look at the conclusion of this apostles story.</p>'),
	(553,7706,'in-our-text-today-the-centurion-has-a-crucial-decision-before-him-to-listen-to-paul-who-had-insight-from-the-lord-or-to-listen-to-the-majority-and-then-experts-unbeknownst-to-him-there-was-a-lot-riding-on-his-choice-how-do-you-make-decisions-if-you-a','In our text today, the centurion has a crucial decision before him - to listen to Paul, who had insight from the Lord, or to listen to the majority and then experts.  Unbeknownst to him, there was a lot riding on his choice. How do you make decisions?  If you are seeking wisdom or direction in some area of life, this message should be a great source of encouragement for you.','in-our-text-today-the-centurion-has-a-crucial-decision-before-him-to-listen-to-paul-who-had-insight-from-the-lord-or-to-listen-to-the-majority-and-then-experts-unbeknownst-to-him-there-was-a-lot-riding-on-his-choice-how-do-you-make-decisions-if-you-a','In our text today, the centurion has a crucial decision before him - to listen to Paul, who had insight from the Lord, or to listen to the majority and then experts.  Unbeknownst to him, there was a lot riding on his choice. How do you make decisions?  If you are seeking wisdom or direction in some area of life, this message should be a great source of encouragement for you.',73,'<p>In our text today, the centurion has a crucial decision before him - to listen to Paul, who had insight from the Lord, or to listen to the majority and then experts.  Unbeknownst to him, there was a lot riding on his choice. How do you make decisions?  If you are seeking wisdom or direction in some area of life, this message should be a great source of encouragement for you.</p>'),
