	(559,7727,'in-revelation-4-1-4-we-find-the-word-meta-tauta-or-after-these-things-brett-begins-to-talk-about-what-john-writes-after-the-history-of-the-church-we-see-the-doors-of-heaven-open-a-trumpet-sound-john-caught-up-in-the-spirit-the-majesty-of-gods-throne-and-t','In Revelation 4:1-4, we find the word meta tauta, or, after these things. Brett begins to talk about what John writes after the history of the church. We see the doors of heaven open, a trumpet sound, John caught up in the spirit, the majesty of Gods throne, and twenty-four elders around the throne.','in-revelation-4-1-4-we-find-the-word-meta-tauta-or-after-these-things-brett-begins-to-talk-about-what-john-writes-after-the-history-of-the-church-we-see-the-doors-of-heaven-open-a-trumpet-sound-john-caught-up-in-the-spirit-the-majesty-of-gods-throne-and-t','In Revelation 4:1-4, we find the word meta tauta, or, after these things. Brett begins to talk about what John writes after the history of the church. We see the doors of heaven open, a trumpet sound, John caught up in the spirit, the majesty of Gods throne, and twenty-four elders around the throne.',54,'<p>In Revelation 4:1-4, we find the word meta tauta, or, after these things. Brett begins to talk about what John writes after the history of the church. We see the doors of heaven open, a trumpet sound, John caught up in the spirit, the majesty of Gods throne, and twenty-four elders around the throne.</p>'),
	(560,7728,'this-morning-we-break-from-our-study-in-romans-and-read-matthew-2-during-this-christmas-season-its-important-to-remember-what-we-are-celebrating-brett-discusses-the-gifts-of-the-wise-men-the-symbolism-therein-and-gods-great-gift-that-he-has-given-us','This morning, we break from our study in Romans and read Matthew 2. During this Christmas season, its important to remember what we are celebrating. Brett discusses the gifts of the wise men, the symbolism therein, and Gods great gift that He has given us.','this-morning-we-break-from-our-study-in-romans-and-read-matthew-2-during-this-christmas-season-its-important-to-remember-what-we-are-celebrating-brett-discusses-the-gifts-of-the-wise-men-the-symbolism-therein-and-gods-great-gift-that-he-has-given-us','This morning, we break from our study in Romans and read Matthew 2. During this Christmas season, its important to remember what we are celebrating. Brett discusses the gifts of the wise men, the symbolism therein, and Gods great gift that He has given us.',45,'<p>This morning, we break from our study in Romans and read Matthew 2. During this Christmas season, its important to remember what we are celebrating. Brett discusses the gifts of the wise men, the symbolism therein, and Gods great gift that He has given us.</p>'),
	(561,7731,'the-new-year-is-just-around-the-corner-usual-new-years-resolutions-include-wanting-to-lose-weight-or-to-kick-a-bad-habitbut-what-if-we-make-this-year-different-brett-talks-about-romans-8-28-and-discusses-the-story-of-joseph-in-genesis-42-as-an-old-testam','The new year is just around the corner. Usual New Years resolutions include wanting to lose weight, or to kick a bad habitbut what if we make this year different? Brett talks about Romans 8:28, and discusses the story of Joseph in Genesis 42 as an old testament picture of this new testament truth. What if this year, we make a resolution to put our trust in the Lord?','the-new-year-is-just-around-the-corner-usual-new-years-resolutions-include-wanting-to-lose-weight-or-to-kick-a-bad-habitbut-what-if-we-make-this-year-different-brett-talks-about-romans-8-28-and-discusses-the-story-of-joseph-in-genesis-42-as-an-old-testam','The new year is just around the corner. Usual New Years resolutions include wanting to lose weight, or to kick a bad habitbut what if we make this year different? Brett talks about Romans 8:28, and discusses the story of Joseph in Genesis 42 as an old testament picture of this new testament truth. What if this year, we make a resolution to put our trust in the Lord?',69,'<p>The new year is just around the corner. Usual New Years resolutions include wanting to lose weight, or to kick a bad habitbut what if we make this year different? Brett talks about Romans 8:28, and discusses the story of Joseph in Genesis 42 as an old testament picture of this new testament truth. What if this year, we make a resolution to put our trust in the Lord?</p>'),
	(562,7733,'this-morning-pastor-brett-discusses-the-topics-of-calvinism-and-arminianism-predestination-and-foreknowledge-in-romans-8-28-29-paul-writes-about-the-called-and-we-see-biblical-examples-of-predestination-for-both-calvinism-and-arminianism-in-exodus-8-where','This morning, Pastor Brett discusses the topics of Calvinism and Arminianism, predestination, and foreknowledge. In Romans 8:28-29, Paul writes about the called, and we see Biblical examples of predestination for both Calvinism and Arminianism in Exodus 8, where we read about some of Pharaohs choices. Were they Gods decisions, or Pharaohs?','this-morning-pastor-brett-discusses-the-topics-of-calvinism-and-arminianism-predestination-and-foreknowledge-in-romans-8-28-29-paul-writes-about-the-called-and-we-see-biblical-examples-of-predestination-for-both-calvinism-and-arminianism-in-exodus-8-where','This morning, Pastor Brett discusses the topics of Calvinism and Arminianism, predestination, and foreknowledge. In Romans 8:28-29, Paul writes about the called, and we see Biblical examples of predestination for both Calvinism and Arminianism in Exodus 8, where we read about some of Pharaohs choices. Were they Gods decisions, or Pharaohs?',51,'<p>This morning, Pastor Brett discusses the topics of Calvinism and Arminianism, predestination, and foreknowledge. In Romans 8:28-29, Paul writes about the called, and we see Biblical examples of predestination for both Calvinism and Arminianism in Exodus 8, where we read about some of Pharaohs choices. Were they Gods decisions, or Pharaohs?</p>'),
	(563,7736,'tonights-text-is-the-letter-to-the-church-at-smyrna-which-is-unique-in-that-there-is-only-commendation-for-this-persecuted-body-of-believers-it-is-easy-to-get-caught-in-the-trap-of-trying-to-be-like-the-world-we-however-are-called-to-be-set-apart-while-ma','Tonights text is the letter to the church at Smyrna, which is unique in that there is only commendation for this persecuted body of believers. It is easy to get caught in the trap of trying to be like the world. We, however, are called to be set apart. While many of us may not suffer persecution, we would be wise to hear what the Spirit says to the churches as we consider the cost of following Jesus.','tonights-text-is-the-letter-to-the-church-at-smyrna-which-is-unique-in-that-there-is-only-commendation-for-this-persecuted-body-of-believers-it-is-easy-to-get-caught-in-the-trap-of-trying-to-be-like-the-world-we-however-are-called-to-be-set-apart-while-ma','Tonights text is the letter to the church at Smyrna, which is unique in that there is only commendation for this persecuted body of believers. It is easy to get caught in the trap of trying to be like the world. We, however, are called to be set apart. While many of us may not suffer persecution, we would be wise to hear what the Spirit says to the churches as we consider the cost of following Jesus.',78,'<p>Tonights text is the letter to the church at Smyrna, which is unique in that there is only commendation for this persecuted body of believers. It is easy to get caught in the trap of trying to be like the world. We, however, are called to be set apart. While many of us may not suffer persecution, we would be wise to hear what the Spirit says to the churches as we consider the cost of following Jesus.</p>'),
	(564,7739,'what-part-does-faith-play-in-our-lives-as-believers-in-todays-teaching-we-spend-some-time-looking-at-the-life-of-moses-he-provided-a-great-example-of-what-it-really-means-to-live-by-faith-may-the-lord-will-reveal-to-us-all-some-areas-of-life-where-our-f','What part does faith play in our lives as believers?  In todays teaching, we spend some time looking at the life of Moses. He provided a great example of what it really means to live by faith. May the Lord will reveal to us all some areas of life where our faith can really spring into action in our daily walks.','what-part-does-faith-play-in-our-lives-as-believers-in-todays-teaching-we-spend-some-time-looking-at-the-life-of-moses-he-provided-a-great-example-of-what-it-really-means-to-live-by-faith-may-the-lord-will-reveal-to-us-all-some-areas-of-life-where-our-f','What part does faith play in our lives as believers?  In todays teaching, we spend some time looking at the life of Moses. He provided a great example of what it really means to live by faith. May the Lord will reveal to us all some areas of life where our faith can really spring into action in our daily walks.',62,'<p>What part does faith play in our lives as believers?  In todays teaching, we spend some time looking at the life of Moses. He provided a great example of what it really means to live by faith. May the Lord will reveal to us all some areas of life where our faith can really spring into action in our daily walks.</p>'),
	(565,7742,'in-romans-11-paul-discusses-gods-faithfulness-we-learn-that-god-is-always-faithful-to-his-people-in-times-of-depression-in-times-of-weakness-and-in-times-of-faithlessness-we-see-this-truth-illustrated-in-i-kings-19-during-elijahs-time-of-depression-weakne','In Romans 11, Paul discusses Gods faithfulness. We learn that God is always faithful to his people in times of depression, in times of weakness, and in times of faithlessness. We see this truth illustrated in I Kings 19, during Elijahs time of depression, weakness, and faithlessness. God was faithful to Elijah, as he will always be faithful to us.','in-romans-11-paul-discusses-gods-faithfulness-we-learn-that-god-is-always-faithful-to-his-people-in-times-of-depression-in-times-of-weakness-and-in-times-of-faithlessness-we-see-this-truth-illustrated-in-i-kings-19-during-elijahs-time-of-depression-weakne','In Romans 11, Paul discusses Gods faithfulness. We learn that God is always faithful to his people in times of depression, in times of weakness, and in times of faithlessness. We see this truth illustrated in I Kings 19, during Elijahs time of depression, weakness, and faithlessness. God was faithful to Elijah, as he will always be faithful to us.',60,'<p>In Romans 11, Paul discusses Gods faithfulness. We learn that God is always faithful to his people in times of depression, in times of weakness, and in times of faithlessness. We see this truth illustrated in I Kings 19, during Elijahs time of depression, weakness, and faithlessness. God was faithful to Elijah, as he will always be faithful to us.</p>'),
	(566,7745,'tonights-passage-has-to-do-with-the-seals-of-the-scroll-which-are-opened-by-the-lamb-these-seven-seals-explain-some-of-the-key-details-of-end-time-events-in-addition-to-enhancing-our-own-understanding-tonights-teaching-should-serve-as-a-reminder-to-be-sha','Tonights passage has to do with the seals of the scroll, which are opened by the Lamb. These seven seals explain some of the key details of end time events. In addition to enhancing our own understanding, tonights teaching should serve as a reminder to be sharing the gospel at every opportunity, in order to see people spared from these awful events.','tonights-passage-has-to-do-with-the-seals-of-the-scroll-which-are-opened-by-the-lamb-these-seven-seals-explain-some-of-the-key-details-of-end-time-events-in-addition-to-enhancing-our-own-understanding-tonights-teaching-should-serve-as-a-reminder-to-be-sha','Tonights passage has to do with the seals of the scroll, which are opened by the Lamb. These seven seals explain some of the key details of end time events. In addition to enhancing our own understanding, tonights teaching should serve as a reminder to be sharing the gospel at every opportunity, in order to see people spared from these awful events.',62,'<p>Tonights passage has to do with the seals of the scroll, which are opened by the Lamb. These seven seals explain some of the key details of end time events. In addition to enhancing our own understanding, tonights teaching should serve as a reminder to be sharing the gospel at every opportunity, in order to see people spared from these awful events.</p>'),
	(567,7746,'in-romans-12-1-paul-urges-the-brethren-to-become-wholly-devoted-to-god-pastor-brett-talks-about-how-we-as-christians-are-to-submit-our-bodies-our-minds-and-our-will-to-the-lord-he-explains-gods-perfect-will-his-permissive-will-and-the-differences-between','In Romans 12:1, Paul urges the brethren to become wholly devoted to God. Pastor Brett talks about how we as Christians are to submit our bodies, our minds, and our will to the Lord. He explains Gods perfect will, His permissive will, and the differences between the two.','in-romans-12-1-paul-urges-the-brethren-to-become-wholly-devoted-to-god-pastor-brett-talks-about-how-we-as-christians-are-to-submit-our-bodies-our-minds-and-our-will-to-the-lord-he-explains-gods-perfect-will-his-permissive-will-and-the-differences-between','In Romans 12:1, Paul urges the brethren to become wholly devoted to God. Pastor Brett talks about how we as Christians are to submit our bodies, our minds, and our will to the Lord. He explains Gods perfect will, His permissive will, and the differences between the two.',48,'<p>In Romans 12:1, Paul urges the brethren to become wholly devoted to God. Pastor Brett talks about how we as Christians are to submit our bodies, our minds, and our will to the Lord. He explains Gods perfect will, His permissive will, and the differences between the two.</p>'),
