	(573,7769,'it-is-no-coincidence-that-paul-follows-up-the-passage-on-spiritual-gifts-with-an-extensive-teaching-about-love-if-the-gifts-are-the-function-of-the-body-parts-then-love-is-the-circulatory-system-which-keeps-it-all-working-well-together-paul-emphasizes-thi','It is no coincidence that Paul follows up the passage on spiritual gifts with an extensive teaching about love. If the gifts are the function of the body parts, then love is the circulatory system which keeps it all working well together. Paul emphasizes this crucial quality that should mark the life of a believer.','it-is-no-coincidence-that-paul-follows-up-the-passage-on-spiritual-gifts-with-an-extensive-teaching-about-love-if-the-gifts-are-the-function-of-the-body-parts-then-love-is-the-circulatory-system-which-keeps-it-all-working-well-together-paul-emphasizes-thi','It is no coincidence that Paul follows up the passage on spiritual gifts with an extensive teaching about love. If the gifts are the function of the body parts, then love is the circulatory system which keeps it all working well together. Paul emphasizes this crucial quality that should mark the life of a believer.',55,'<p>It is no coincidence that Paul follows up the passage on spiritual gifts with an extensive teaching about love. If the gifts are the function of the body parts, then love is the circulatory system which keeps it all working well together. Paul emphasizes this crucial quality that should mark the life of a believer.</p>'),
