	(577,7773,'we-cover-a-lot-of-ground-tonight-as-we-finish-up-pauls-checklist-of-practical-ways-to-show-love-within-the-church-he-follows-this-up-with-chapter-13-which-outlines-our-responsibility-to-honor-and-submit-to-governing-authorities-in-our-lives-love-is-the-fu','We cover a lot of ground tonight as we finish up Pauls checklist of practical ways to show love within the church. He follows this up with chapter 13, which outlines our responsibility to honor and submit to governing authorities in our lives. Love is the fulfillment of the law, is the overarching theme of these chapters.','we-cover-a-lot-of-ground-tonight-as-we-finish-up-pauls-checklist-of-practical-ways-to-show-love-within-the-church-he-follows-this-up-with-chapter-13-which-outlines-our-responsibility-to-honor-and-submit-to-governing-authorities-in-our-lives-love-is-the-fu','We cover a lot of ground tonight as we finish up Pauls checklist of practical ways to show love within the church. He follows this up with chapter 13, which outlines our responsibility to honor and submit to governing authorities in our lives. Love is the fulfillment of the law, is the overarching theme of these chapters.',57,'<p>We cover a lot of ground tonight as we finish up Pauls checklist of practical ways to show love within the church. He follows this up with chapter 13, which outlines our responsibility to honor and submit to governing authorities in our lives. Love is the fulfillment of the law, is the overarching theme of these chapters.</p>'),
	(578,7774,'revelation-8-taught-us-that-the-seventh-seal-consisted-of-seven-angels-with-seven-trumpets-we-covered-the-first-four-last-week-but-then-things-change-gears-while-the-first-four-trumpets-dealt-with-earthly-cataclysmic-events-tonight-we-look-at-the-fifth-wh','Revelation 8 taught us that the seventh seal consisted of seven angels, with seven trumpets. We covered the first four last week, but then things change gears. While the first four trumpets dealt with earthly, cataclysmic events, tonight we look at the fifth, which is more demonic in nature as evil is unleashed on the earth.','revelation-8-taught-us-that-the-seventh-seal-consisted-of-seven-angels-with-seven-trumpets-we-covered-the-first-four-last-week-but-then-things-change-gears-while-the-first-four-trumpets-dealt-with-earthly-cataclysmic-events-tonight-we-look-at-the-fifth-wh','Revelation 8 taught us that the seventh seal consisted of seven angels, with seven trumpets. We covered the first four last week, but then things change gears. While the first four trumpets dealt with earthly, cataclysmic events, tonight we look at the fifth, which is more demonic in nature as evil is unleashed on the earth.',56,'<p>Revelation 8 taught us that the seventh seal consisted of seven angels, with seven trumpets. We covered the first four last week, but then things change gears. While the first four trumpets dealt with earthly, cataclysmic events, tonight we look at the fifth, which is more demonic in nature as evil is unleashed on the earth.</p>'),
	(579,7775,'romans-14-10-12-talks-about-facing-the-musicwere-all-going-to-be-accountable-for-our-actions-in-this-life-on-judgment-day-paul-reiterates-isaiah-45-23-saying-that-every-knee-will-bow-and-every-tongue-will-confess-to-god','Romans 14:10-12 talks about facing the musicWere all going to be accountable for our actions in this life on judgment day. Paul reiterates Isaiah 45:23, saying that every knee will bow and every tongue will confess to God.','romans-14-10-12-talks-about-facing-the-musicwere-all-going-to-be-accountable-for-our-actions-in-this-life-on-judgment-day-paul-reiterates-isaiah-45-23-saying-that-every-knee-will-bow-and-every-tongue-will-confess-to-god','Romans 14:10-12 talks about facing the musicWere all going to be accountable for our actions in this life on judgment day. Paul reiterates Isaiah 45:23, saying that every knee will bow and every tongue will confess to God.',38,'<p>Romans 14:10-12 talks about facing the musicWere all going to be accountable for our actions in this life on judgment day. Paul reiterates Isaiah 45:23, saying that every knee will bow and every tongue will confess to God.</p>'),
	(580,7776,'among-christians-there-are-plenty-of-conduct-issues-that-are-debatable-and-boy-are-they-debated-tonight-we-take-a-good-look-at-what-gods-word-has-to-say-about-our-motives-and-what-drives-our-decisions-regarding-these-issues-we-will-also-be-challenged-wi','Among Christians, there are plenty of conduct issues that are debatable. And boy are they debated!  Tonight, we take a good look at what Gods Word has to say about our motives and what drives our decisions regarding these issues. We will also be challenged with what our posture should be toward fellow believers when it comes to these same topics.','among-christians-there-are-plenty-of-conduct-issues-that-are-debatable-and-boy-are-they-debated-tonight-we-take-a-good-look-at-what-gods-word-has-to-say-about-our-motives-and-what-drives-our-decisions-regarding-these-issues-we-will-also-be-challenged-wi','Among Christians, there are plenty of conduct issues that are debatable. And boy are they debated!  Tonight, we take a good look at what Gods Word has to say about our motives and what drives our decisions regarding these issues. We will also be challenged with what our posture should be toward fellow believers when it comes to these same topics.',62,'<p>Among Christians, there are plenty of conduct issues that are debatable. And boy are they debated!  Tonight, we take a good look at what Gods Word has to say about our motives and what drives our decisions regarding these issues. We will also be challenged with what our posture should be toward fellow believers when it comes to these same topics.</p>'),
	(581,7777,'the-seventh-seal-reveals-seven-angels-with-seven-trumpets-tonight-well-take-a-look-at-the-first-four-trumpet-judgments-each-of-these-have-to-do-with-cataclysmic-events-that-will-impact-the-earth-the-seas-the-freshwater-and-the-heavens-the-chapter-ends-wit','The seventh seal reveals seven angels with seven trumpets. Tonight, well take a look at the first four trumpet judgments. Each of these have to do with cataclysmic events that will impact the earth, the seas, the freshwater and the heavens. The chapter ends with a chilling warning about the three judgments yet to come','the-seventh-seal-reveals-seven-angels-with-seven-trumpets-tonight-well-take-a-look-at-the-first-four-trumpet-judgments-each-of-these-have-to-do-with-cataclysmic-events-that-will-impact-the-earth-the-seas-the-freshwater-and-the-heavens-the-chapter-ends-wit','The seventh seal reveals seven angels with seven trumpets. Tonight, well take a look at the first four trumpet judgments. Each of these have to do with cataclysmic events that will impact the earth, the seas, the freshwater and the heavens. The chapter ends with a chilling warning about the three judgments yet to come',55,'<p>The seventh seal reveals seven angels with seven trumpets. Tonight, well take a look at the first four trumpet judgments. Each of these have to do with cataclysmic events that will impact the earth, the seas, the freshwater and the heavens. The chapter ends with a chilling warning about the three judgments yet to come</p>'),
