	(586,7782,'tonight-we-take-a-break-from-our-revelation-study-to-examine-current-events-in-light-of-biblical-prophecy-tonights-teaching-will-provide-a-deeper-understanding-of-both-the-trouble-we-see-all-around-us-and-the-solution-we-all-seek','Tonight we take a break from our Revelation study to examine current events in light of Biblical prophecy. Tonights teaching will provide a deeper understanding of both the trouble we see all around us, and the solution we all seek.','tonight-we-take-a-break-from-our-revelation-study-to-examine-current-events-in-light-of-biblical-prophecy-tonights-teaching-will-provide-a-deeper-understanding-of-both-the-trouble-we-see-all-around-us-and-the-solution-we-all-seek','Tonight we take a break from our Revelation study to examine current events in light of Biblical prophecy. Tonights teaching will provide a deeper understanding of both the trouble we see all around us, and the solution we all seek.',40,'<p>Tonight we take a break from our Revelation study to examine current events in light of Biblical prophecy. Tonights teaching will provide a deeper understanding of both the trouble we see all around us, and the solution we all seek.</p>'),
	(587,7783,'romans-15-serves-as-a-poignant-conclusion-to-the-previous-chapters-about-our-freedom-we-take-some-time-tonight-to-look-at-some-old-testament-examples-of-people-who-gave-up-their-own-liberties-to-prefer-others-it-is-a-powerful-reminder-that-we-are-blessed','Romans 15 serves as a poignant conclusion to the previous chapters about our freedom. We take some time tonight to look at some Old Testament examples of people who gave up their own liberties to prefer others. It is a powerful reminder that we are blessed and the Body is blessed when we show selfless consideration to one another.','romans-15-serves-as-a-poignant-conclusion-to-the-previous-chapters-about-our-freedom-we-take-some-time-tonight-to-look-at-some-old-testament-examples-of-people-who-gave-up-their-own-liberties-to-prefer-others-it-is-a-powerful-reminder-that-we-are-blessed','Romans 15 serves as a poignant conclusion to the previous chapters about our freedom. We take some time tonight to look at some Old Testament examples of people who gave up their own liberties to prefer others. It is a powerful reminder that we are blessed and the Body is blessed when we show selfless consideration to one another.',59,'<p>Romans 15 serves as a poignant conclusion to the previous chapters about our freedom. We take some time tonight to look at some Old Testament examples of people who gave up their own liberties to prefer others. It is a powerful reminder that we are blessed and the Body is blessed when we show selfless consideration to one another.</p>'),
	(588,7784,'as-we-begin-a-new-book-tonight-we-spend-some-time-learning-about-the-historical-city-of-corinth-often-called-carnal-corinth-the-church-in-this-city-faced-some-serious-challenges-paul-begins-his-letter-with-greetings-to-the-church-commendations-for-the-thi','As we begin a new book tonight, we spend some time learning about the historical city of Corinth. Often called Carnal Corinth, the church in this city faced some serious challenges. Paul begins his letter with greetings to the church, commendations for the things they were doing well, a challenge to unity and encouragement regarding their position as believers.','as-we-begin-a-new-book-tonight-we-spend-some-time-learning-about-the-historical-city-of-corinth-often-called-carnal-corinth-the-church-in-this-city-faced-some-serious-challenges-paul-begins-his-letter-with-greetings-to-the-church-commendations-for-the-thi','As we begin a new book tonight, we spend some time learning about the historical city of Corinth. Often called Carnal Corinth, the church in this city faced some serious challenges. Paul begins his letter with greetings to the church, commendations for the things they were doing well, a challenge to unity and encouragement regarding their position as believers.',59,'<p>As we begin a new book tonight, we spend some time learning about the historical city of Corinth. Often called Carnal Corinth, the church in this city faced some serious challenges. Paul begins his letter with greetings to the church, commendations for the things they were doing well, a challenge to unity and encouragement regarding their position as believers.</p>'),
	(589,7785,'tonight-is-another-sideline-chapter-that-breaks-away-from-the-chronological-order-of-the-seal-judgments-to-describe-a-specific-event-john-sees-a-powerful-angel-descend-from-heaven-who-announces-the-impending-seventh-trumpet-judgment-and-a-great-mystery-th','Tonight is another sideline chapter that breaks away from the chronological order of the seal judgments to describe a specific event. John sees a powerful angel descend from heaven who announces the impending seventh trumpet judgment and a great mystery that will be revealed. We also take a look at their interaction regarding a scroll and the applications that apply to us.','tonight-is-another-sideline-chapter-that-breaks-away-from-the-chronological-order-of-the-seal-judgments-to-describe-a-specific-event-john-sees-a-powerful-angel-descend-from-heaven-who-announces-the-impending-seventh-trumpet-judgment-and-a-great-mystery-th','Tonight is another sideline chapter that breaks away from the chronological order of the seal judgments to describe a specific event. John sees a powerful angel descend from heaven who announces the impending seventh trumpet judgment and a great mystery that will be revealed. We also take a look at their interaction regarding a scroll and the applications that apply to us.',62,'<p>Tonight is another sideline chapter that breaks away from the chronological order of the seal judgments to describe a specific event. John sees a powerful angel descend from heaven who announces the impending seventh trumpet judgment and a great mystery that will be revealed. We also take a look at their interaction regarding a scroll and the applications that apply to us.</p>'),
	(590,7786,'in-this-day-and-age-there-is-so-much-sin-all-over-the-television-internet-music-and-the-media-in-romans-16-19-paul-talks-about-being-simple-concerning-evil-when-applied-to-what-we-deal-with-today-this-means-to-simply-tune-out-the-things-that-are-not-of-th','In this day and age, there is so much sin all over the television, internet, music, and the media. In Romans 16:19, Paul talks about being simple concerning evil. When applied to what we deal with today, this means to simply tune out the things that are not of the Lord.','in-this-day-and-age-there-is-so-much-sin-all-over-the-television-internet-music-and-the-media-in-romans-16-19-paul-talks-about-being-simple-concerning-evil-when-applied-to-what-we-deal-with-today-this-means-to-simply-tune-out-the-things-that-are-not-of-th','In this day and age, there is so much sin all over the television, internet, music, and the media. In Romans 16:19, Paul talks about being simple concerning evil. When applied to what we deal with today, this means to simply tune out the things that are not of the Lord.',51,'<p>In this day and age, there is so much sin all over the television, internet, music, and the media. In Romans 16:19, Paul talks about being simple concerning evil. When applied to what we deal with today, this means to simply tune out the things that are not of the Lord.</p>'),
	(591,7787,'oftentimes-the-lord-uses-the-weak-and-the-foolish-to-preach-his-word-paul-writes-to-the-corinthians-a-pretty-messed-up-church-about-this-this-morning-pastor-brett-discusses-the-preachers-approach-the-preachers-attitude-and-the-preachers-aim-and-how-it-rel','Oftentimes, the Lord uses the weak and the foolish to preach His word. Paul writes to the Corinthians, a pretty messed up church, about this. This morning, Pastor Brett discusses the preachers approach, the preachers attitude, and the preachers aim, and how it relates to our lives today.','oftentimes-the-lord-uses-the-weak-and-the-foolish-to-preach-his-word-paul-writes-to-the-corinthians-a-pretty-messed-up-church-about-this-this-morning-pastor-brett-discusses-the-preachers-approach-the-preachers-attitude-and-the-preachers-aim-and-how-it-rel','Oftentimes, the Lord uses the weak and the foolish to preach His word. Paul writes to the Corinthians, a pretty messed up church, about this. This morning, Pastor Brett discusses the preachers approach, the preachers attitude, and the preachers aim, and how it relates to our lives today.',48,'<p>Oftentimes, the Lord uses the weak and the foolish to preach His word. Paul writes to the Corinthians, a pretty messed up church, about this. This morning, Pastor Brett discusses the preachers approach, the preachers attitude, and the preachers aim, and how it relates to our lives today.</p>'),
