	(593,7789,'as-political-and-military-unrest-seems-to-be-rampantly-spreading-we-have-a-unique-opportunity-to-contrast-the-spirit-of-the-world-with-the-spirit-of-god-growing-deeper-in-our-walk-with-the-lord-will-result-in-wisdom-and-maturity-the-more-we-see-of-the-wor','As political and military unrest seems to be rampantly spreading, we have a unique opportunity to contrast the spirit of the world, with the Spirit of God. Growing deeper in our walk with the Lord will result in wisdom and maturity. The more we see of the world and what seems chaotic and hopeless, the more we see the need for this kind of insight and discernment.','as-political-and-military-unrest-seems-to-be-rampantly-spreading-we-have-a-unique-opportunity-to-contrast-the-spirit-of-the-world-with-the-spirit-of-god-growing-deeper-in-our-walk-with-the-lord-will-result-in-wisdom-and-maturity-the-more-we-see-of-the-wor','As political and military unrest seems to be rampantly spreading, we have a unique opportunity to contrast the spirit of the world, with the Spirit of God. Growing deeper in our walk with the Lord will result in wisdom and maturity. The more we see of the world and what seems chaotic and hopeless, the more we see the need for this kind of insight and discernment.',67,'<p>As political and military unrest seems to be rampantly spreading, we have a unique opportunity to contrast the spirit of the world, with the Spirit of God. Growing deeper in our walk with the Lord will result in wisdom and maturity. The more we see of the world and what seems chaotic and hopeless, the more we see the need for this kind of insight and discernment.</p>'),
