	(606,7802,'this-sunday-resurrection-sunday-pastor-brett-discusses-i-corinthians-15-12-23-here-paul-explains-that-if-christ-hadnt-risen-from-the-grave-then-our-faith-would-be-in-vain-our-preaching-would-be-in-vain-and-wed-still-be-in-our-sins-but-because-he-has-risen','This Sunday, Resurrection Sunday, Pastor Brett discusses I Corinthians 15:12-23. Here, Paul explains that if Christ hadnt risen from the grave, then our faith would be in vain, our preaching would be in vain, and wed still be in our sins. But because he has risen, weve been redeemed!','this-sunday-resurrection-sunday-pastor-brett-discusses-i-corinthians-15-12-23-here-paul-explains-that-if-christ-hadnt-risen-from-the-grave-then-our-faith-would-be-in-vain-our-preaching-would-be-in-vain-and-wed-still-be-in-our-sins-but-because-he-has-risen','This Sunday, Resurrection Sunday, Pastor Brett discusses I Corinthians 15:12-23. Here, Paul explains that if Christ hadnt risen from the grave, then our faith would be in vain, our preaching would be in vain, and wed still be in our sins. But because he has risen, weve been redeemed!',49,'<p>This Sunday, Resurrection Sunday, Pastor Brett discusses I Corinthians 15:12-23. Here, Paul explains that if Christ hadnt risen from the grave, then our faith would be in vain, our preaching would be in vain, and wed still be in our sins. But because he has risen, weve been redeemed!</p>'),
