	(688,12645,'this-morning-pastor-brett-looks-at-ephesians-6-10-where-paul-tells-the-church-at-ephesus-to-be-strong-in-the-lord-the-devil-is-at-work-but-the-lord-is-much-much-greater-pastor-brett-talks-about-the-cards-that-satan-likes-to-play-and-how-we-as-christians-c','This morning, Pastor Brett looks at Ephesians 6:10, where Paul tells the church at Ephesus to be strong in the Lord. The devil is at work, but the Lord is much, much greater. Pastor Brett talks about the cards that Satan likes to play, and how we as Christians can combat them.','this-morning-pastor-brett-looks-at-ephesians-6-10-where-paul-tells-the-church-at-ephesus-to-be-strong-in-the-lord-the-devil-is-at-work-but-the-lord-is-much-much-greater-pastor-brett-talks-about-the-cards-that-satan-likes-to-play-and-how-we-as-christians-c','This morning, Pastor Brett looks at Ephesians 6:10, where Paul tells the church at Ephesus to be strong in the Lord. The devil is at work, but the Lord is much, much greater. Pastor Brett talks about the cards that Satan likes to play, and how we as Christians can combat them.',52,'<p>This morning, Pastor Brett looks at Ephesians 6:10, where Paul tells the church at Ephesus to be strong in the Lord. The devil is at work, but the Lord is much, much greater. Pastor Brett talks about the cards that Satan likes to play, and how we as Christians can combat them.</p>'),
	(689,12646,'this-christmas-eve-we-take-a-moment-to-remind-ourselves-of-what-god-has-done-for-us-today-the-world-forgets-that-god-dwelt-among-us-people-go-through-a-lot-of-pain-and-suffering-and-we-need-to-remember-that-god-came-to-this-earth-as-a-man-and-lived-throug','This Christmas eve, we take a moment to remind ourselves of what God has done for us. Today, the world forgets that God dwelt among us. People go through a lot of pain and suffering, and we need to remember that God came to this earth as a man and lived through pain and suffering as well, so that we could be saved.','this-christmas-eve-we-take-a-moment-to-remind-ourselves-of-what-god-has-done-for-us-today-the-world-forgets-that-god-dwelt-among-us-people-go-through-a-lot-of-pain-and-suffering-and-we-need-to-remember-that-god-came-to-this-earth-as-a-man-and-lived-throug','This Christmas eve, we take a moment to remind ourselves of what God has done for us. Today, the world forgets that God dwelt among us. People go through a lot of pain and suffering, and we need to remember that God came to this earth as a man and lived through pain and suffering as well, so that we could be saved.',63,'<p>This Christmas eve, we take a moment to remind ourselves of what God has done for us. Today, the world forgets that God dwelt among us. People go through a lot of pain and suffering, and we need to remember that God came to this earth as a man and lived through pain and suffering as well, so that we could be saved.</p>'),
	(690,12647,'since-over-26-percent-of-the-bible-is-about-prophecy-its-important-to-stay-current-with-all-of-the-happenings-around-the-world-as-we-bring-in-the-new-year-pastor-brett-takes-a-moment-to-look-at-some-of-the-events-that-have-occurred-over-the-course-of-2011','Since over 26 percent of the Bible is about prophecy, its important to stay current with all of the happenings around the world. As we bring in the new year, Pastor Brett takes a moment to look at some of the events that have occurred over the course of 2011 that line up perfectly with Bible prophecy.','since-over-26-percent-of-the-bible-is-about-prophecy-its-important-to-stay-current-with-all-of-the-happenings-around-the-world-as-we-bring-in-the-new-year-pastor-brett-takes-a-moment-to-look-at-some-of-the-events-that-have-occurred-over-the-course-of-2011','Since over 26 percent of the Bible is about prophecy, its important to stay current with all of the happenings around the world. As we bring in the new year, Pastor Brett takes a moment to look at some of the events that have occurred over the course of 2011 that line up perfectly with Bible prophecy.',57,'<p>Since over 26 percent of the Bible is about prophecy, its important to stay current with all of the happenings around the world. As we bring in the new year, Pastor Brett takes a moment to look at some of the events that have occurred over the course of 2011 that line up perfectly with Bible prophecy.</p>'),
	(691,7744,'our-text-tonight-describes-a-picture-of-the-throne-and-what-was-going-on-around-it-from-this-somewhat-brief-passage-we-learn-a-lot-about-a-wide-range-of-topics-from-decision-making-to-the-tribes-of-israel-to-our-purpose-in-life-there-are-a-lot-of-rich-l','Our text tonight describes a picture of the throne and what was going on around it. From this somewhat brief passage, we learn a lot about a wide range of topics - from decision-making to the Tribes of Israel to our purpose in life. There are a lot of rich lessons in tonights teaching.','our-text-tonight-describes-a-picture-of-the-throne-and-what-was-going-on-around-it-from-this-somewhat-brief-passage-we-learn-a-lot-about-a-wide-range-of-topics-from-decision-making-to-the-tribes-of-israel-to-our-purpose-in-life-there-are-a-lot-of-rich-l','Our text tonight describes a picture of the throne and what was going on around it. From this somewhat brief passage, we learn a lot about a wide range of topics - from decision-making to the Tribes of Israel to our purpose in life. There are a lot of rich lessons in tonights teaching.',54,'<p>Our text tonight describes a picture of the throne and what was going on around it. From this somewhat brief passage, we learn a lot about a wide range of topics - from decision-making to the Tribes of Israel to our purpose in life. There are a lot of rich lessons in tonights teaching.</p>'),
	(692,12648,'on-this-christmas-night-pastor-brett-takes-a-moment-to-discuss-the-wise-men-that-came-to-bethlehem-to-see-jesus-we-see-how-they-came-what-they-did-and-how-they-left','On this Christmas night, Pastor Brett takes a moment to discuss the wise men that came to Bethlehem to see Jesus. We see how they came, what they did, and how they left.','on-this-christmas-night-pastor-brett-takes-a-moment-to-discuss-the-wise-men-that-came-to-bethlehem-to-see-jesus-we-see-how-they-came-what-they-did-and-how-they-left','On this Christmas night, Pastor Brett takes a moment to discuss the wise men that came to Bethlehem to see Jesus. We see how they came, what they did, and how they left.',33,'<p>On this Christmas night, Pastor Brett takes a moment to discuss the wise men that came to Bethlehem to see Jesus. We see how they came, what they did, and how they left.</p>'),
	(693,12649,'as-we-continue-our-study-through-the-book-of-philippians-we-read-that-paul-kept-the-philippians-in-his-mind-he-remembered-them-in-prayer-and-he-had-them-in-his-heart-we-learn-that-we-can-take-lessons-of-how-we-should-treat-others-in-the-church-from-the-wa','As we continue our study through the book of Philippians, we read that Paul kept the Philippians in his mind, he remembered them in prayer, and he had them in his heart. We learn that we can take lessons of how we should treat others in the church from the way Paul treats the Philippians.','as-we-continue-our-study-through-the-book-of-philippians-we-read-that-paul-kept-the-philippians-in-his-mind-he-remembered-them-in-prayer-and-he-had-them-in-his-heart-we-learn-that-we-can-take-lessons-of-how-we-should-treat-others-in-the-church-from-the-wa','As we continue our study through the book of Philippians, we read that Paul kept the Philippians in his mind, he remembered them in prayer, and he had them in his heart. We learn that we can take lessons of how we should treat others in the church from the way Paul treats the Philippians.',55,'<p>As we continue our study through the book of Philippians, we read that Paul kept the Philippians in his mind, he remembered them in prayer, and he had them in his heart. We learn that we can take lessons of how we should treat others in the church from the way Paul treats the Philippians.</p>');
