	(31,12638,NULL,'###1st & 3rd Sundays, 4:30 PM###\r\n\r\nChildcare will be provided for kids in a separate room during home group. It is also important to note that this group rotates locations each meeting time.\r\n\r\n1st Sunday:\r\nTim & Shanna Browning\r\n14709 Sassafras Way\r\nOregon City, OR 97045\r\n\r\n3rd Sunday:\r\nDarin & Jana Baker\r\n19359 Windmill Dr.\r\nOregon City, OR 97045',NULL,'###1st & 3rd Sundays, 4:30 PM###\r\n\r\nChildcare will be provided for kids in a separate room during home group. It is also important to note that this group rotates locations each meeting time.\r\n\r\n1st Sunday:\r\nTim & Shanna Browning\r\n14709 Sassafras Way\r\nOregon City, OR 97045\r\n\r\n3rd Sunday:\r\nDarin & Jana Baker\r\n19359 Windmill Dr.\r\nOregon City, OR 97045',51,'<h3>1st &amp; 3rd Sundays, 4:30 PM</h3>\n\n<p>Childcare will be provided for kids in a separate room during home group. It is also important to note that this group rotates locations each meeting time.</p>\n\n<p>1st Sunday:\nTim &amp; Shanna Browning\n14709 Sassafras Way\nOregon City, OR 97045</p>\n\n<p>3rd Sunday:\nDarin &amp; Jana Baker\n19359 Windmill Dr.\nOregon City, OR 97045</p>\n'),
