VALUES
	(13,47,NULL,'## Offering a refreshing look at what it means to be a godly woman\r\n\r\n\r\nOur approach to Womens Ministry at Athey Creek is rather simple.  In *Titus 2:3-5*, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.\r\n\r\nJudy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120. ',NULL,'## Offering a refreshing look at what it means to be a godly woman\r\n\r\n\r\nOur approach to Womens Ministry at Athey Creek is rather simple.  In *Titus 2:3-5*, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.\r\n\r\nJudy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120. ',214,'<h2>Offering a refreshing look at what it means to be a godly woman</h2>\n\n<p>Our approach to Womens Ministry at Athey Creek is rather simple.  In <em>Titus 2:3-5</em>, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.</p>\n\n<p>Judy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120.</p>\n'),
	(14,49,NULL,'## Becoming a man after God\'s own heart\r\n\r\nThe worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ. \r\n\r\nAs hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.\r\n\r\nIf you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.\r\n',NULL,'## Becoming a man after God\'s own heart\r\n\r\nThe worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ. \r\n\r\nAs hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.\r\n\r\nIf you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.\r\n',205,'<h2>Becoming a man after God&#8217;s own heart</h2>\n\n<p>The worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ.</p>\n\n<p>As hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.</p>\n\n<p>If you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.</p>\n'),
	(15,50,NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',138,'<h2>Growing closer in our walks with Jesus</h2>\n\n<p>Whether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him.</p>\n\n<p>David &amp; Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College &amp; Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.</p>\n'),
	(16,51,NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',196,'<p>The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.</p>\n\n<p>Fellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus.</p>\n\n<p>Take a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don&#8217;t forget to check out the High School Ministry&#8217;s very own website on the side of the page!</p>\n\n<p>If you have any questions, contact Abe Menshenfriend at (971)222-9586.</p>\n'),
	(17,52,NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Seth at (503) 984-6605.',NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Seth at (503) 984-6605.',122,'<p>Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!</p>\n\n<p>If you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!</p>\n\n<p>If you have any questions, you can contact Seth at (503) 984-6605.</p>\n'),
	(18,53,NULL,'## Caring for the kids of our Fellowship\r\n\r\nThanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.\r\n\r\nGod bless you,\r\n\r\nJames',NULL,'## Caring for the kids of our Fellowship\r\n\r\nThanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.\r\n\r\nGod bless you,\r\n\r\nJames',70,'<h2>Caring for the kids of our Fellowship</h2>\n\n<p>Thanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.</p>\n\n<p>God bless you,</p>\n\n<p>James</p>\n'),
	(19,54,NULL,'## Mission Work at Athey\r\n\r\nWe have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.\r\n\r\nThere are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!\r\n\r\nChoose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.',NULL,'## Mission Work at Athey\r\n\r\nWe have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.\r\n\r\nThere are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!\r\n\r\nChoose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.',185,'<h2>Mission Work at Athey</h2>\n\n<p>We have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.</p>\n\n<p>There are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!</p>\n\n<p>Choose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.</p>\n'),
	(20,56,NULL,'The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.',NULL,'The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.',86,'<p>The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.</p>\n'),
