ly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him.</p>\n\n<p>David &amp; Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College &amp; Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.</p>\n'),
	(30,77,NULL,'### Saturday at 6:00 PM\r\n### Sunday at 8:30 AM and 11:00 AM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',NULL,'### Saturday at 6:00 PM\r\n### Sunday at 8:30 AM and 11:00 AM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',264,'<h3>Saturday at 6:00 PM</h3>\n\n<h3>Sunday at 8:30 AM and 11:00 AM</h3>\n\n<h4>Athey Creek Christian Fellowship</h4>\n\n<h4>27520 SW 95th Ave</h4>\n\n<h4>Wilsonville, OR 97070</h4>\n\n<p>Our Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.</p>\n\n<p>In John 4:23, Jesus says that the Father seeks those who will worship Him &#8216;in spirit and in truth.&#8217; With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that &#8220;all things be done decently, and in order&#8221; (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.</p>\n\n<p>While the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.</p>\n'),
	(31,79,NULL,'## Going deeper into God\'s Word\r\n\r\n### Wednesday at 7:00 PM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',NULL,'## Going deeper into God\'s Word\r\n\r\n### Wednesday at 7:00 PM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',106,'<h2>Going deeper into God&#8217;s Word</h2>\n\n<h3>Wednesday at 7:00 PM</h3>\n\n<h4>Athey Creek Christian Fellowship</h4>\n\n<h4>27520 SW 95th Ave</h4>\n\n<h4>Wilsonville, OR 97070</h4>\n\n<p>Wednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.</p>\n\n<p>During this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.</p>\n'),
	(41,90,NULL,'##Ouagadougou, Burkina Faso\r\n\r\n###Daniel and Elizabeth Delma\r\n\r\nIn 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.\r\n\r\nPrayer Requests:\r\n\r\nThe Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.',NULL,'##Ouagadougou, Burkina Faso\r\n\r\n###Daniel and Elizabeth Delma\r\n\r\nIn 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.\r\n\r\nPrayer Requests:\r\n\r\nThe Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.',309,'<h2>Ouagadougou, Burkina Faso</h2>\n\n<h3>Daniel and Elizabeth Delma</h3>\n\n<p>In 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.</p>\n\n<p>Prayer Requests:</p>\n\n<p>The Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.</p>\n'),
	(42,89,NULL,'##Brazil\r\n\r\n###Mike & Kelli Anderson\r\n###Emily 3 and Lydia 1 & 1/2\r\n\r\n\r\nMike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.\r\n\r\nPrayer Requests:\r\n\r\nWe praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!',NULL,'##Brazil\r\n\r\n###Mike & Kelli Anderson\r\n###Emily 3 and Lydia 1 & 1/2\r\n\r\n\r\nMike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.\r\n\r\nPrayer Requests:\r\n\r\nWe praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!',155,'<h2>Brazil</h2>\n\n<h3>Mike &amp; Kelli Anderson</h3>\n\n<h3>Emily 3 and Lydia 1 &amp; 1/2</h3>\n\n<p>Mike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.</p>\n\n<p>Prayer Requests:</p>\n\n<p>We praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!</p>\n'),
	(43,91,NULL,'##Lima, Peru\r\n\r\n###Gino and Darci Canesssa\r\n\r\nLima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men & women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.\r\n\r\n   \r\n\r\nPrayer Requests:\r\n\r\nPraise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\r\n That Jesus would always be the center of our marriage and our home\r\nThat it would always be Jesus who ministers through us\r\n That we would be filled with and guided by the Holy Spirit\r\n Darcis health\r\n Ginos teachings throughout the week\r\n That God would reach His people and transform their lives for His glory\r\n For the many youth and kids that we are ministering to',NULL,'##Lima, Peru\r\n\r\n###Gino and Darci Canesssa\r\n\r\nLima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men & women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.\r\n\r\n   \r\n\r\nPrayer Requests:\r\n\r\nPraise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\r\n That Jesus would always be the center of our marriage and our home\r\nThat it would always be Jesus who ministers through us\r\n That we would be filled with and guided by the Holy Spirit\r\n Darcis health\r\n Ginos teachings throughout the week\r\n That God would reach His people and transform their lives for His glory\r\n For the many youth and kids that we are ministering to',246,'<h2>Lima, Peru</h2>\n\n<h3>Gino and Darci Canesssa</h3>\n\n<p>Lima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men &amp; women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.</p>\n\n<p>Prayer Requests:</p>\n\n<p>Praise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\n That Jesus would always be the center of our marriage and our home\nThat it would always be Jesus who ministers through us\n That we would be filled with and guided by the Holy Spirit\n Darcis health\n Ginos teachings throughout the week\n That God would reach His people and transform their lives for His glory\n For the many youth and kids that we are ministering to</p>\n'),
	(50,95,NULL,'##Kampala, Uganda##\r\n\r\n###Randy and Alisa Varga###           \r\n###Josh, Eli and Gabe###\r\n\r\n\r\nRandy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.\r\n\r\n\r\nPrayer Requests:\r\n\r\nHey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.\r\n',NULL,'##Kampala, Uganda##\r\n\r\n###Randy and Alisa Varga###           \r\n###Josh, Eli and Gabe###\r\n\r\n\r\nRandy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.\r\n\r\n\r\nPrayer Requests:\r\n\r\nHey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.\r\n',176,'<h2>Kampala, Uganda</h2>\n\n<h3>Randy and Alisa Varga</h3>\n\n<h3>Josh, Eli and Gabe</h3>\n\n<p>Randy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.</p>\n\n<p>Prayer Requests:</p>\n\n<p>Hey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.</p>\n'),
	(52,97,NULL,'##The Islands of Vanuatu##\r\n\r\n###Tad and Marna Slaughter\r\n###Joel (Wheaton), Amy (Wheaton) and John###\r\n\r\nThe Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word. \r\n\r\nPrayer Requests:\r\n\r\nThe Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities! ',NULL,'##The Islands of Vanuatu##\r\n\r\n###Tad and Marna Slaughter\r\n###Joel (Wheaton), Amy (Wheaton) and John###\r\n\r\nThe Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word. \r\n\r\nPrayer Requests:\r\n\r\nThe Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities! ',215,'<h2>The Islands of Vanuatu</h2>\n\n<h3>Tad and Marna Slaughter</h3>\n\n<h3>Joel (Wheaton), Amy (Wheaton) and John</h3>\n\n<p>The Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word.</p>\n\n<p>Prayer Requests:</p>\n\n<p>The Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities!</p>\n'),
	(53,93,NULL,'##Holsbybrunn, Sweden##\r\n\r\n###Jesse & Krista Ashmen###\r\n###Eleri 2###\r\n\r\nWe are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way. \r\n\r\n\r\nPrayer Requests:\r\n\r\nFor our ministry:\r\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\r\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\r\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\r\nFor us personally:\r\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl. ',NULL,'##Holsbybrunn, Sweden##\r\n\r\n###Jesse & Krista Ashmen###\r\n###Eleri 2###\r\n\r\nWe are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way. \r\n\r\n\r\nPrayer Requests:\r\n\r\nFor our ministry:\r\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\r\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\r\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\r\nFor us personally:\r\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl. ',248,'<h2>Holsbybrunn, Sweden</h2>\n\n<h3>Jesse &amp; Krista Ashmen</h3>\n\n<h3>Eleri 2</h3>\n\n<p>We are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way.</p>\n\n<p>Prayer Requests:</p>\n\n<p>For our ministry:\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\nFor us personally:\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl.</p>\n'),
	(58,7763,NULL,'##Wednesday Night Through-the-Bible Study##\r\n###Wednesday Night at 7:00 PM###\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',NULL,'##Wednesday Night Through-the-Bible Study##\r\n###Wednesday Night at 7:00 PM###\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',97,'<h2>Wednesday Night Through-the-Bible Study</h2>\n\n<h3>Wednesday Night at 7:00 PM</h3>\n\n<p>Wednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.</p>\n\n<p>During this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.</p>\n'),
	(59,7762,NULL,'##Weekend Worship Services##\r\n###Saturday Night at 6:00 PM###\r\n###Sunday Morning at 8:30 AM and 11:00 AM###\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',NULL,'##Weekend Worship Services##\r\n###Saturday Night at 6:00 PM###\r\n###Sunday Morning at 8:30 AM and 11:00 AM###\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',260,'<h2>Weekend Worship Services</h2>\n\n<h3>Saturday Night at 6:00 PM</h3>\n\n<h3>Sunday Morning at 8:30 AM and 11:00 AM</h3>\n\n<p>Our Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.</p>\n\n<p>In John 4:23, Jesus says that the Father seeks those who will worship Him &#8216;in spirit and in truth.&#8217; With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that &#8220;all things be done decently, and in order&#8221; (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.</p>\n\n<p>While the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.</p>\n'),
	(66,12475,NULL,'## We are blessed to come along side our brothers and sisters around the world.\r\n\r\nThe area known as Natanara is located about 20 minutes from Luganville down an American road built in World War Two by the Allies. Over 100,000 Americans at a time were in Luganville during the war to prevent the Japanese from completely capturing the Pacific. This was a staging area for the battles in the Solomon Islands. The remnants of World War Two are still put to good use. Virtually every road on Santo was built during the war and many buildings in town also date from this period. Natanara is a coastal area that is covered by coconut plantations and scattered settlements. The people of Natanara Christian Fellowship come from a large area with many walking over an hour and a half each way to church and back. Most of these people hail from other islands and speak different languages. It is not uncommon for the people in the fellowship to be conversant in five or more languages. Usually English is their third or fourth best language. The language most commonly used in Vanuatu is Bislama, which is a form of Pidgin English. This is the language that Pastor Floyd Bani and his assistants Steve Moli and Bradley Ngwera use in teaching the Bible.\r\n\r\nAt Natanara fellowship, church is an all day event. Before the church family arrives, Pastor Floyd, Steve and Bradley must put in several hours in preparation. Beginning at 5:30 a.m. they rake the leaves that continually fall. With no running water, they make many trips carrying five gallon buckets to the various locations where fresh water will needed throughout the day. Then the process of making lunch begins with the boiling of three huge pots of rice. Rice is the staple that goes with every meal in Vanuatu. As early as eight oclock people begin trickling in for the service that starts at ten. Some come to help, others come to rest and enjoy relaxing on the peaceful grounds. Lunch follows the service and is a time for fellowship and laughter. The children will often start a game of soccer, basketball, or just play together. Many of the older youth and adults play volleyball. Others escape the heat and humidity with a nap on the shaded grass while being cooled by the soft ocean breeze. Around half past four in the afternoon following a short time of worship, the church family begins dispersing and making their way back home. The only things to be seen at the close of the day are the coals of a burning fire in the darkness with the three men gathered around worshipping the Lord.\r\n\r\nFloyd Bani has been the pastor of Natanara Christian Fellowship for the last year and a half. He had spent the previous year as the childrens pastor in [Fanafo](/87/vanuatu/fanafo/ \"Fanafo\") before returning to Natanara. Floyd is a gifted Bible teacher who keeps the emphasis on Jesus Christ in a way that is refreshing. Steve Moli and Bradley Ngwera help in many ways around the fellowship. They do everything from leading worship to teaching the children to cooking. They are beautiful examples of serving the lord with joy and humility.',NULL,'## We are blessed to come along side our brothers and sisters around the world.\r\n\r\nThe area known as Natanara is located about 20 minutes from Luganville down an American road built in World War Two by the Allies. Over 100,000 Americans at a time were in Luganville during the war to prevent the Japanese from completely capturing the Pacific. This was a staging area for the battles in the Solomon Islands. The remnants of World War Two are still put to good use. Virtually every road on Santo was built during the war and many buildings in town also date from this period. Natanara is a coastal area that is covered by coconut plantations and scattered settlements. The people of Natanara Christian Fellowship come from a large area with many walking over an hour and a half each way to church and back. Most of these people hail from other islands and speak different languages. It is not uncommon for the people in the fellowship to be conversant in five or more languages. Usually English is their third or fourth best language. The language most commonly used in Vanuatu is Bislama, which is a form of Pidgin English. This is the language that Pastor Floyd Bani and his assistants Steve Moli and Bradley Ngwera use in teaching the Bible.\r\n\r\nAt Natanara fellowship, church is an all day event. Before the church family arrives, Pastor Floyd, Steve and Bradley must put in several hours in preparation. Beginning at 5:30 a.m. they rake the leaves that continually fall. With no running water, they make many trips carrying five gallon buckets to the various locations where fresh water will needed throughout the day. Then the process of making lunch begins with the boiling of three huge pots of rice. Rice is the staple that goes with every meal in Vanuatu. As early as eight oclock people begin trickling in for the service that starts at ten. Some come to help, others come to rest and enjoy relaxing on the peaceful grounds. Lunch follows the service and is a time for fellowship and laughter. The children will often start a game of soccer, basketball, or just play together. Many of the older youth and adults play volleyball. Others escape the heat and humidity with a nap on the shaded grass while being cooled by the soft ocean breeze. Around half past four in the afternoon following a short time of worship, the church family begins dispersing and making their way back home. The only things to be seen at the close of the day are the coals of a burning fire in the darkness with the three men gathered around worshipping the Lord.\r\n\r\nFloyd Bani has been the pastor of Natanara Christian Fellowship for the last year and a half. He had spent the previous year as the childrens pastor in [Fanafo](/87/vanuatu/fanafo/ \"Fanafo\") before returning to Natanara. Floyd is a gifted Bible teacher who keeps the emphasis on Jesus Christ in a way that is refreshing. Steve Moli and Bradley Ngwera help in many ways around the fellowship. They do everything from leading worship to teaching the children to cooking. They are beautiful examples of serving the lord with joy and humility.',536,'<h2>We are blessed to come along side our brothers and sisters around the world.</h2>\n\n<p>The area known as Natanara is located about 20 minutes from Luganville down an American road built in World War Two by the Allies. Over 100,000 Americans at a time were in Luganville during the war to prevent the Japanese from completely capturing the Pacific. This was a staging area for the battles in the Solomon Islands. The remnants of World War Two are still put to good use. Virtually every road on Santo was built during the war and many buildings in town also date from this period. Natanara is a coastal area that is covered by coconut plantations and scattered settlements. The people of Natanara Christian Fellowship come from a large area with many walking over an hour and a half each way to church and back. Most of these people hail from other islands and speak different languages. It is not uncommon for the people in the fellowship to be conversant in five or more languages. Usually English is their third or fourth best language. The language most commonly used in Vanuatu is Bislama, which is a form of Pidgin English. This is the language that Pastor Floyd Bani and his assistants Steve Moli and Bradley Ngwera use in teaching the Bible.</p>\n\n<p>At Natanara fellowship, church is an all day event. Before the church family arrives, Pastor Floyd, Steve and Bradley must put in several hours in preparation. Beginning at 5:30 a.m. they rake the leaves that continually fall. With no running water, they make many trips carrying five gallon buckets to the various locations where fresh water will needed throughout the day. Then the process of making lunch begins with the boiling of three huge pots of rice. Rice is the staple that goes with every meal in Vanuatu. As early as eight oclock people begin trickling in for the service that starts at ten. Some come to help, others come to rest and enjoy relaxing on the peaceful grounds. Lunch follows the service and is a time for fellowship and laughter. The children will often start a game of soccer, basketball, or just play together. Many of the older youth and adults play volleyball. Others escape the heat and humidity with a nap on the shaded grass while being cooled by the soft ocean breeze. Around half past four in the afternoon following a short time of worship, the church family begins dispersing and making their way back home. The only things to be seen at the close of the day are the coals of a burning fire in the darkness with the three men gathered around worshipping the Lord.</p>\n\n<p>Floyd Bani has been the pastor of Natanara Christian Fellowship for the last year and a half. He had spent the previous year as the childrens pastor in <a href=\"/87/vanuatu/fanafo/\" title=\"Fanafo\">Fanafo</a> before returning to Natanara. Floyd is a gifted Bible teacher who keeps the emphasis on Jesus Christ in a way that is refreshing. Steve Moli and Bradley Ngwera help in many ways around the fellowship. They do everything from leading worship to teaching the children to cooking. They are beautiful examples of serving the lord with joy and humility.</p>\n'),
	(67,12476,NULL,'## We are blessed to come along side our brothers and sisters around the world.\r\n\r\nFanafo Village is actually a grouping of many mini villages situated very closely together. It is about an hours drive from Natanara Christian Fellowship and 45 minutes from the town of Luganville. Fanafo is dotted with the remains of hastily built anti-aircraft bunkers and Quonset huts left by the Allied forces (primarily American) during World War Two. It is an area with several small churches but also with numerous people who are still following their tribal religions. This area was the home of a political rebellion in 1980 that came to a head when men from Fanafo took over Luganville using bows and arrows, spears and unearthed rifles left behind during WWII. They were successful until the government received assistance from Papua New Guinea who sent a gunship and threatened to quash the rebellion with overwhelming force. Fanafo still has many who would prefer to see Vanuatu return to the old ways and to remove all foreign influences.\r\n\r\nSeveral years ago, Pastor Zachy, returned to his home in Fanafo after graduating from Searchlight Bible College. He began sharing the Word of God with his family and with his relatives in the village. This was the beginning of Fanafo Christian Fellowship. Now Pastor Zachy has started another church in his area, splitting his time teaching each church two Sundays a month. The original church is located in his area of the village, while the other is over an hours trek through the jungle to a distant, smaller village. He has been doing this for several years now and is praying that the Lord will send him someone who knows the language who can also teach the people about the grace and freedom that are found in Jesus Christ.',NULL,'## We are blessed to come along side our brothers and sisters around the world.\r\n\r\nFanafo Village is actually a grouping of many mini villages situated very closely together. It is about an hours drive from Natanara Christian Fellowship and 45 minutes from the town of Luganville. Fanafo is dotted with the remains of hastily built anti-aircraft bunkers and Quonset huts left by the Allied forces (primarily American) during World War Two. It is an area with several small churches but also with numerous people who are still following their tribal religions. This area was the home of a political rebellion in 1980 that came to a head when men from Fanafo took over Luganville using bows and arrows, spears and unearthed rifles left behind during WWII. They were successful until the government received assistance from Papua New Guinea who sent a gunship and threatened to quash the rebellion with overwhelming force. Fanafo still has many who would prefer to see Vanuatu return to the old ways and to remove all foreign influences.\r\n\r\nSeveral years ago, Pastor Zachy, returned to his home in Fanafo after graduating from Searchlight Bible College. He began sharing the Word of God with his family and with his relatives in the village. This was the beginning of Fanafo Christian Fellowship. Now Pastor Zachy has started another church in his area, splitting his time teaching each church two Sundays a month. The original church is located in his area of the village, while the other is over an hours trek through the jungle to a distant, smaller village. He has been doing this for several years now and is praying that the Lord will send him someone who knows the language who can also teach the people about the grace and freedom that are found in Jesus Christ.',299,'<h2>We are blessed to come along side our brothers and sisters around the world.</h2>\n\n<p>Fanafo Village is actually a grouping of many mini villages situated very closely together. It is about an hours drive from Natanara Christian Fellowship and 45 minutes from the town of Luganville. Fanafo is dotted with the remains of hastily built anti-aircraft bunkers and Quonset huts left by the Allied forces (primarily American) during World War Two. It is an area with several small churches but also with numerous people who are still following their tribal religions. This area was the home of a political rebellion in 1980 that came to a head when men from Fanafo took over Luganville using bows and arrows, spears and unearthed rifles left behind during WWII. They were successful until the government received assistance from Papua New Guinea who sent a gunship and threatened to quash the rebellion with overwhelming force. Fanafo still has many who would prefer to see Vanuatu return to the old ways and to remove all foreign influences.</p>\n\n<p>Several years ago, Pastor Zachy, returned to his home in Fanafo after graduating from Searchlight Bible College. He began sharing the Word of God with his family and with his relatives in the village. This was the beginning of Fanafo Christian Fellowship. Now Pastor Zachy has started another church in his area, splitting his time teaching each church two Sundays a month. The original church is located in his area of the village, while the other is over an hours trek through the jungle to a distant, smaller village. He has been doing this for several years now and is praying that the Lord will send him someone who knows the language who can also teach the people about the grace and freedom that are found in Jesus Christ.</p>\n'),
	(93,12478,NULL,'###In a Nutshell...\r\n\r\n- We are ALL sinners.\r\n- The consequence of our sin is eternal separation from God.\r\n- God loves us! He loves us so much He sent His Son Jesus to die for our sins. He lived a sinless life, died on a cross and rose again from the dead.\r\n- All we need to do is talk to the Lord - confess our sin, ask Him for forgiveness and invite Him into our lives.\r\n- Once that prayer is prayed, we can be certain of eternal life in Heaven with God.\r\n- In order to live this life to the fullest, it is best to start studying the Bible, to spend time with the Lord by praying and to get plugged into a church that teaches the Bible.\r\n\r\n###Heres a further explanation...\r\n\r\n###Who we are\r\n\r\nMany of us tend to think of ourselves as pretty good people. We think, \"Well, I\'m not a murderer. I pay my taxes. I love my family. I try to be a good citizen. I think I\'m doing pretty well!\" We compare ourselves to the really bad people and conclude that we must be good. However, the Bible says in Romans 3:10-11, \"...There is no one righteous, not even one; there is no one who understands, no one who seeks God.\" You see, we can not compare ourselves to other people to determine our goodness. We have to compare ourselves to the ultimate standard of goodness. We have to compare ourselves to God. In this light, we are all sinful men and women, living in a fallen world. Try as we may to be good, to do good things, we cannot escape the fact that we are powerless to do it on our own. Romans 3:23 tells us that \"all have sinned and fallen short of the glory of God.\" That\'s all sin is...falling short of God\'s best and we are all guilty of it.\r\n\r\n###What We Deserve\r\nThe consequences for this sin are dire. Further on in Romans 6:23, the Bible tells us \"The wages of sin is death, but the gift of God is eternal life in Christ Jesus our Lord.\" So while we deserve death for our sin, the Lord provides a way out of that consequence. He doesn\'t just turn a blind eye to our shortcomings. That would deny His righteous nature. Instead He offers another way for that debt to be satisfied.\r\n\r\n###What God Offers\r\nJohn 3:16 says \"For God so loved the world that He gave His only begotten Son that whosoever believeth in Him should not perish, but have everlasting life.\" There are a few important things to notice about this passage. One aspect is the fact that it is belief in Jesus that allows us to enjoy eternal life AND avoid the eternal death we all deserve. But perhaps the most profound truth is the reason behind all of this: God\'s love! That is the gospel in a nutshell, it is the Good NewsGod LOVES you! While many people envision the Lord as some cosmic being who looks down on us all with a scowl and a pointed finger, the opposite is actually true. He is a loving Creator who loves His creation so deeply, so fervently, that He sacrificed His only Son to offer us eternal life with Him in Heaven.\r\n\r\nJesus lived a sinless life on earth, and His death on a cross fulfilled the demand. His innocent death served as the sacrifice for our sins. In 2 Corinthians 5:21 it says, \"God made Him who had no sin to be sin for us, so that in Him we might become the righteousness of God.\" He bridged the gap between sinful people and a holy God. In addition to this perfect sacrifice, He conquered death and rose again. He is a living Savior! And the Bible says in 1 Peter 1:3-4, \"Praise be to the God and Father of our Lord Jesus Christ! In His great mercy He has given us birth into a living hope through the resurrections from the dead, and into an inheritance that can never perish, spoil or fade  kept in heaven for you...\" His resurrection provides our certain hope of eternal life in heaven with Him!\r\n\r\n###How It Works\r\nHow do we receive salvation? Romans 10:9-10 tells us \"That if you confess with your mouth, \'Jesus is Lord,\' and believe in your heart that God raised Him from the dead, you will be saved.\" Later on in that same chapter, in verse 13 it says, \"Everyone who calls on the name of the Lord will be saved.\" This is something the Lord longs to do for each and every person! Praying to God may seem a little scary, but it is simply a matter of talking to Him. He is anxious to hear you call out to Him! You can simply admit that you are a sinner in need of a Savior. Confess that you believe in the work He did on the cross for you and ask Him to forgive your sins and to come to live in your heart. That\'s all there is to it!\r\n\r\n###What Then?\r\nAsking Jesus into your life as your Savior is the first step of an incredible, eternal journey! You have become a child of God, a member of the family of believers! There are a couple things you can do to help you grow in this new life. Keep in mind, however, that these things you do will never be things that save you. That part is done! Jesus tells us in John 10:10 \"...I have come that they may have life, and have it to the full.\" He doesn\'t want us to simply get through this life, He wants us to live an abundant life! It is the quality of our lives that is affected by our growth in Him!\r\n\r\n**Pray**  talk to the Lord. Your existence is a delight to Him! (Zephaniah 3:17) He wants the relationship you share with Him to grow deeper and stronger. Talking to Him is a great place to start!\r\n\r\n**Study the Bible**  the Bible is God\'s love letter to you. It is the owner\'s manual for this life we live. As you read it you will discover more about who God is, how He wants us to live and how you can grow as a follower of Him! In 2 Timothy 3:16-17 we learn that Scripture is \'God-breathed.\' This means that God Himself speaks to us through these pages. If studying the Bible seems intimidating, start in the book of John. It is a straightforward account of Jesus\' life here on earth. Remember that God wants to reveal Himself to you. He will be faithful to do this as you read His Word.\r\n\r\n**Plug into a church**  Find a church that teaches the Bible faithfully. Being involved in a church helps us grow in our knowledge of the Lord and His Word. It also enables us to fellowship  to have other Christians come alongside us as we walk through this life. Find a church where you can receive sound teaching from the Bible, fellowship with other believers, worship and pray.\r\n\r\n**Tell someone**  You don\'t have to be an expert on doctrine or theology before you share the Lord with others. Your own salvation experience is your testimony! There is a dying world in need of a Savior and you know Him now. So feel free to share what the Lord has done in your life...and hang on for the ride!\r\n\r\n[**Contact Us**](/88/about/contact-us/ \"Contact Us\")  Please feel free to contact our church office if you have any questions or need some direction. We have pastors and elders who would be happy to speak with you or pray with you. Giving your life to Jesus is the most important decision you will ever make and you will never be sorry. In fact, you will wonder how you survived a day without Him. May the Lord bless you!',NULL,'###In a Nutshell...\r\n\r\n- We are ALL sinners.\r\n- The consequence of our sin is eternal separation from God.\r\n- God loves us! He loves us so much He sent His Son Jesus to die for our sins. He lived a sinless life, died on a cross and rose again from the dead.\r\n- All we need to do is talk to the Lord - confess our sin, ask Him for forgiveness and invite Him into our lives.\r\n- Once that prayer is prayed, we can be certain of eternal life in Heaven with God.\r\n- In order to live this life to the fullest, it is best to start studying the Bible, to spend time with the Lord by praying and to get plugged into a church that teaches the Bible.\r\n\r\n###Heres a further explanation...\r\n\r\n###Who we are\r\n\r\nMany of us tend to think of ourselves as pretty good people. We think, \"Well, I\'m not a murderer. I pay my taxes. I love my family. I try to be a good citizen. I think I\'m doing pretty well!\" We compare ourselves to the really bad people and conclude that we must be good. However, the Bible says in Romans 3:10-11, \"...There is no one righteous, not even one; there is no one who understands, no one who seeks God.\" You see, we can not compare ourselves to other people to determine our goodness. We have to compare ourselves to the ultimate standard of goodness. We have to compare ourselves to God. In this light, we are all sinful men and women, living in a fallen world. Try as we may to be good, to do good things, we cannot escape the fact that we are powerless to do it on our own. Romans 3:23 tells us that \"all have sinned and fallen short of the glory of God.\" That\'s all sin is...falling short of God\'s best and we are all guilty of it.\r\n\r\n###What We Deserve\r\nThe consequences for this sin are dire. Further on in Romans 6:23, the Bible tells us \"The wages of sin is death, but the gift of God is eternal life in Christ Jesus our Lord.\" So while we deserve death for our sin, the Lord provides a way out of that consequence. He doesn\'t just turn a blind eye to our shortcomings. That would deny His righteous nature. Instead He offers another way for that debt to be satisfied.\r\n\r\n###What God Offers\r\nJohn 3:16 says \"For God so loved the world that He gave His only begotten Son that whosoever believeth in Him should not perish, but have everlasting life.\" There are a few important things to notice about this passage. One aspect is the fact that it is belief in Jesus that allows us to enjoy eternal life AND avoid the eternal death we all deserve. But perhaps the most profound truth is the reason behind all of this: God\'s love! That is the gospel in a nutshell, it is the Good NewsGod LOVES you! While many people envision the Lord as some cosmic being who looks down on us all with a scowl and a pointed finger, the opposite is actually true. He is a loving Creator who loves His creation so deeply, so fervently, that He sacrificed His only Son to offer us eternal life with Him in Heaven.\r\n\r\nJesus lived a sinless life on earth, and His death on a cross fulfilled the demand. His innocent death served as the sacrifice for our sins. In 2 Corinthians 5:21 it says, \"God made Him who had no sin to be sin for us, so that in Him we might become the righteousness of God.\" He bridged the gap between sinful people and a holy God. In addition to this perfect sacrifice, He conquered death and rose again. He is a living Savior! And the Bible says in 1 Peter 1:3-4, \"Praise be to the God and Father of our Lord Jesus Christ! In His great mercy He has given us birth into a living hope through the resurrections from the dead, and into an inheritance that can never perish, spoil or fade  kept in heaven for you...\" His resurrection provides our certain hope of eternal life in heaven with Him!\r\n\r\n###How It Works\r\nHow do we receive salvation? Romans 10:9-10 tells us \"That if you confess with your mouth, \'Jesus is Lord,\' and believe in your heart that God raised Him from the dead, you will be saved.\" Later on in that same chapter, in verse 13 it says, \"Everyone who calls on the name of the Lord will be saved.\" This is something the Lord longs to do for each and every person! Praying to God may seem a little scary, but it is simply a matter of talking to Him. He is anxious to hear you call out to Him! You can simply admit that you are a sinner in need of a Savior. Confess that you believe in the work He did on the cross for you and ask Him to forgive your sins and to come to live in your heart. That\'s all there is to it!\r\n\r\n###What Then?\r\nAsking Jesus into your life as your Savior is the first step of an incredible, eternal journey! You have become a child of God, a member of the family of believers! There are a couple things you can do to help you grow in this new life. Keep in mind, however, that these things you do will never be things that save you. That part is done! Jesus tells us in John 10:10 \"...I have come that they may have life, and have it to the full.\" He doesn\'t want us to simply get through this life, He wants us to live an abundant life! It is the quality of our lives that is affected by our growth in Him!\r\n\r\n**Pray**  talk to the Lord. Your existence is a delight to Him! (Zephaniah 3:17) He wants the relationship you share with Him to grow deeper and stronger. Talking to Him is a great place to start!\r\n\r\n**Study the Bible**  the Bible is God\'s love letter to you. It is the owner\'s manual for this life we live. As you read it you will discover more about who God is, how He wants us to live and how you can grow as a follower of Him! In 2 Timothy 3:16-17 we learn that Scripture is \'God-breathed.\' This means that God Himself speaks to us through these pages. If studying the Bible seems intimidating, start in the book of John. It is a straightforward account of Jesus\' life here on earth. Remember that God wants to reveal Himself to you. He will be faithful to do this as you read His Word.\r\n\r\n**Plug into a church**  Find a church that teaches the Bible faithfully. Being involved in a church helps us grow in our knowledge of the Lord and His Word. It also enables us to fellowship  to have other Christians come alongside us as we walk through this life. Find a church where you can receive sound teaching from the Bible, fellowship with other believers, worship and pray.\r\n\r\n**Tell someone**  You don\'t have to be an expert on doctrine or theology before you share the Lord with others. Your own salvation experience is your testimony! There is a dying world in need of a Savior and you know Him now. So feel free to share what the Lord has done in your life...and hang on for the ride!\r\n\r\n[**Contact Us**](/88/about/contact-us/ \"Contact Us\")  Please feel free to contact our church office if you have any questions or need some direction. We have pastors and elders who would be happy to speak with you or pray with you. Giving your life to Jesus is the most important decision you will ever make and you will never be sorry. In fact, you will wonder how you survived a day without Him. May the Lord bless you!',1315,'<h3>In a Nutshell&#8230;</h3>\n\n<ul>\n<li>We are ALL sinners.</li>\n<li>The consequence of our sin is eternal separation from God.</li>\n<li>God loves us! He loves us so much He sent His Son Jesus to die for our sins. He lived a sinless life, died on a cross and rose again from the dead.</li>\n<li>All we need to do is talk to the Lord - confess our sin, ask Him for forgiveness and invite Him into our lives.</li>\n<li>Once that prayer is prayed, we can be certain of eternal life in Heaven with God.</li>\n<li>In order to live this life to the fullest, it is best to start studying the Bible, to spend time with the Lord by praying and to get plugged into a church that teaches the Bible.</li>\n</ul>\n\n<h3>Heres a further explanation&#8230;</h3>\n\n<h3>Who we are</h3>\n\n<p>Many of us tend to think of ourselves as pretty good people. We think, &#8220;Well, I&#8217;m not a murderer. I pay my taxes. I love my family. I try to be a good citizen. I think I&#8217;m doing pretty well!&#8221; We compare ourselves to the really bad people and conclude that we must be good. However, the Bible says in Romans 3:10-11, &#8220;&#8230;There is no one righteous, not even one; there is no one who understands, no one who seeks God.&#8221; You see, we can not compare ourselves to other people to determine our goodness. We have to compare ourselves to the ultimate standard of goodness. We have to compare ourselves to God. In this light, we are all sinful men and women, living in a fallen world. Try as we may to be good, to do good things, we cannot escape the fact that we are powerless to do it on our own. Romans 3:23 tells us that &#8220;all have sinned and fallen short of the glory of God.&#8221; That&#8217;s all sin is&#8230;falling short of God&#8217;s best and we are all guilty of it.</p>\n\n<h3>What We Deserve</h3>\n\n<p>The consequences for this sin are dire. Further on in Romans 6:23, the Bible tells us &#8220;The wages of sin is death, but the gift of God is eternal life in Christ Jesus our Lord.&#8221; So while we deserve death for our sin, the Lord provides a way out of that consequence. He doesn&#8217;t just turn a blind eye to our shortcomings. That would deny His righteous nature. Instead He offers another way for that debt to be satisfied.</p>\n\n<h3>What God Offers</h3>\n\n<p>John 3:16 says &#8220;For God so loved the world that He gave His only begotten Son that whosoever believeth in Him should not perish, but have everlasting life.&#8221; There are a few important things to notice about this passage. One aspect is the fact that it is belief in Jesus that allows us to enjoy eternal life AND avoid the eternal death we all deserve. But perhaps the most profound truth is the reason behind all of this: God&#8217;s love! That is the gospel in a nutshell, it is the Good NewsGod LOVES you! While many people envision the Lord as some cosmic being who looks down on us all with a scowl and a pointed finger, the opposite is actually true. He is a loving Creator who loves His creation so deeply, so fervently, that He sacrificed His only Son to offer us eternal life with Him in Heaven.</p>\n\n<p>Jesus lived a sinless life on earth, and His death on a cross fulfilled the demand. His innocent death served as the sacrifice for our sins. In 2 Corinthians 5:21 it says, &#8220;God made Him who had no sin to be sin for us, so that in Him we might become the righteousness of God.&#8221; He bridged the gap between sinful people and a holy God. In addition to this perfect sacrifice, He conquered death and rose again. He is a living Savior! And the Bible says in 1 Peter 1:3-4, &#8220;Praise be to the God and Father of our Lord Jesus Christ! In His great mercy He has given us birth into a living hope through the resurrections from the dead, and into an inheritance that can never perish, spoil or fade  kept in heaven for you&#8230;&#8221; His resurrection provides our certain hope of eternal life in heaven with Him!</p>\n\n<h3>How It Works</h3>\n\n<p>How do we receive salvation? Romans 10:9-10 tells us &#8220;That if you confess with your mouth, &#8216;Jesus is Lord,&#8217; and believe in your heart that God raised Him from the dead, you will be saved.&#8221; Later on in that same chapter, in verse 13 it says, &#8220;Everyone who calls on the name of the Lord will be saved.&#8221; This is something the Lord longs to do for each and every person! Praying to God may seem a little scary, but it is simply a matter of talking to Him. He is anxious to hear you call out to Him! You can simply admit that you are a sinner in need of a Savior. Confess that you believe in the work He did on the cross for you and ask Him to forgive your sins and to come to live in your heart. That&#8217;s all there is to it!</p>\n\n<h3>What Then?</h3>\n\n<p>Asking Jesus into your life as your Savior is the first step of an incredible, eternal journey! You have become a child of God, a member of the family of believers! There are a couple things you can do to help you grow in this new life. Keep in mind, however, that these things you do will never be things that save you. That part is done! Jesus tells us in John 10:10 &#8220;&#8230;I have come that they may have life, and have it to the full.&#8221; He doesn&#8217;t want us to simply get through this life, He wants us to live an abundant life! It is the quality of our lives that is affected by our growth in Him!</p>\n\n<p><strong>Pray</strong>  talk to the Lord. Your existence is a delight to Him! (Zephaniah 3:17) He wants the relationship you share with Him to grow deeper and stronger. Talking to Him is a great place to start!</p>\n\n<p><strong>Study the Bible</strong>  the Bible is God&#8217;s love letter to you. It is the owner&#8217;s manual for this life we live. As you read it you will discover more about who God is, how He wants us to live and how you can grow as a follower of Him! In 2 Timothy 3:16-17 we learn that Scripture is &#8216;God-breathed.&#8217; This means that God Himself speaks to us through these pages. If studying the Bible seems intimidating, start in the book of John. It is a straightforward account of Jesus&#8217; life here on earth. Remember that God wants to reveal Himself to you. He will be faithful to do this as you read His Word.</p>\n\n<p><strong>Plug into a church</strong>  Find a church that teaches the Bible faithfully. Being involved in a church helps us grow in our knowledge of the Lord and His Word. It also enables us to fellowship  to have other Christians come alongside us as we walk through this life. Find a church where you can receive sound teaching from the Bible, fellowship with other believers, worship and pray.</p>\n\n<p><strong>Tell someone</strong>  You don&#8217;t have to be an expert on doctrine or theology before you share the Lord with others. Your own salvation experience is your testimony! There is a dying world in need of a Savior and you know Him now. So feel free to share what the Lord has done in your life&#8230;and hang on for the ride!</p>\n\n<p><a href=\"/88/about/contact-us/\" title=\"Contact Us\"><strong>Contact Us</strong></a>  Please feel free to contact our church office if you have any questions or need some direction. We have pastors and elders who would be happy to speak with you or pray with you. Giving your life to Jesus is the most important decision you will ever make and you will never be sorry. In fact, you will wonder how you survived a day without Him. May the Lord bless you!</p>\n'),
	(95,12480,NULL,'###The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.\r\n\r\nWe believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.\r\n\r\nWe believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.\r\n1 Corinthians 13\r\n\r\nWe believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do. \r\nEphesians 2:8-9 \r\n\r\nWe believe the marks of a maturing church are Faith, Hope and Love. \r\nColossians 1:3-7\r\n\r\nWe believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow. \r\nRomans 10:17, 2 Timothy 3:16\r\n\r\nWe live in anticipation of the return of Jesus, for He is our Blessed Hope.\r\nTitus 2:13\r\n\r\nWe desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.\r\nGalatians 5:22\r\n',NULL,'###The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.\r\n\r\nWe believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.\r\n\r\nWe believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.\r\n1 Corinthians 13\r\n\r\nWe believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do. \r\nEphesians 2:8-9 \r\n\r\nWe believe the marks of a maturing church are Faith, Hope and Love. \r\nColossians 1:3-7\r\n\r\nWe believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow. \r\nRomans 10:17, 2 Timothy 3:16\r\n\r\nWe live in anticipation of the return of Jesus, for He is our Blessed Hope.\r\nTitus 2:13\r\n\r\nWe desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.\r\nGalatians 5:22\r\n',259,'<h3>The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.</h3>\n\n<p>We believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.</p>\n\n<p>We believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.\n1 Corinthians 13</p>\n\n<p>We believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do. \nEphesians 2:8-9</p>\n\n<p>We believe the marks of a maturing church are Faith, Hope and Love. \nColossians 1:3-7</p>\n\n<p>We believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow. \nRomans 10:17, 2 Timothy 3:16</p>\n\n<p>We live in anticipation of the return of Jesus, for He is our Blessed Hope.\nTitus 2:13</p>\n\n<p>We desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.\nGalatians 5:22</p>\n'),
	(117,12485,NULL,'> \"Bring all the tithes into the storehouse, That there may be food in My house, And try Me now in this,\" Says the LORD of hosts, \"If I will not open for you the windows of heaven And pour out for you such blessing That there will not be room enough to receive it.\" - Malachi 3:10\r\n\r\nFor your convenience we now have the ability to accept tithes and offerings electronically via our online giving page.  We use PayPal for our financial transactions to guarantee that your funds transfers are private and secure. \r\n\r\nAthey Creek is faithfully committed to good stewardship and integrity in the management of the resources God has provided us. \r\n\r\nThank you for your heart of giving to the Lord! \r\n\r\n<a href=\"https://accf.webconnex.com/giving/\" target=\"_blank\">online giving</a>',NULL,'> \"Bring all the tithes into the storehouse, That there may be food in My house, And try Me now in this,\" Says the LORD of hosts, \"If I will not open for you the windows of heaven And pour out for you such blessing That there will not be room enough to receive it.\" - Malachi 3:10\r\n\r\nFor your convenience we now have the ability to accept tithes and offerings electronically via our online giving page.  We use PayPal for our financial transactions to guarantee that your funds transfers are private and secure. \r\n\r\nAthey Creek is faithfully committed to good stewardship and integrity in the management of the resources God has provided us. \r\n\r\nThank you for your heart of giving to the Lord! \r\n\r\n<a href=\"https://accf.webconnex.com/giving/\" target=\"_blank\">online giving</a>',123,'<blockquote>\n  <p>&#8220;Bring all the tithes into the storehouse, That there may be food in My house, And try Me now in this,&#8221; Says the LORD of hosts, &#8220;If I will not open for you the windows of heaven And pour out for you such blessing That there will not be room enough to receive it.&#8221; - Malachi 3:10</p>\n</blockquote>\n\n<p>For your convenience we now have the ability to accept tithes and offerings electronically via our online giving page.  We use PayPal for our financial transactions to guarantee that your funds transfers are private and secure.</p>\n\n<p>Athey Creek is faithfully committed to good stewardship and integrity in the management of the resources God has provided us.</p>\n\n<p>Thank you for your heart of giving to the Lord!</p>\n\n<p><a href=\"https://accf.webconnex.com/giving/\" target=\"_blank\">online giving</a></p>\n'),
	(118,12484,NULL,'###How to Get Plugged In\r\n\r\n###The Importance of Fellowship\r\n\r\nIn Christ, there are no strangers but instead brothers and sisters. Ephesians 2:19-21 reminds us of this, \'\'Now, therefore you are no longer strangers and foreigners, but fellow citizens with the saints and members of the household of God, having been built on the foundation of the apostles and prophets, Jesus Christ Himself being the chief cornerstone in whom the whole building, being fitted together, grows into a holy temple in the Lord, in whom you also are being built together for a dwelling place of God in the Spirit.\'\' Christ desires for us to find our place in the fellowship - we are the living stones that build His house.\r\n\r\n###Getting Started\r\nThe first step is to try to get to know the pastors, elders, deacons and staff at Athey Creek.  Our pastors and elders are always available at the close of each service, and they would love the chance to meet you.  These men are also available for prayer, to answer questions or just to chat. If you are looking for further ways to connect, there are several ways to do this.\r\n\r\n###Events\r\nWhether it is retreats, Family Camp, rafting or BBQs, there are plenty of chances to meet members of the body outside of our Sundays and Wednesdays together. Watch for information in the church bulletin or on the [calendar page](/20/events/ \"calendar page\").\r\n\r\n###Serving\r\nAnother way to get involved is to serve. There are several ministries at Athey Creek where the focus is on meeting the needs of others.\r\n\r\n- [Childrens ministry](/101/about/getting-involved/#children \"Children\'s ministry\")\r\n- [Parking Lot](/101/about/getting-involved/#parking \"Parking Lot\")\r\n- [Servant Ministry](/101/about/getting-involved/#servant \"Servant Ministry\")\r\n\r\nThese are all ways to be a part of what the Lord is doing at Athey. You can call the church office for more information on any opportunities to serve.\r\n\r\nIf you are new to the fellowship, we invite you to simply enjoy the Lord and take in the Word for a few months. We hope this will be a time of refreshment for you, allowing you to get a feel for our flavor and understand the why behind much of what we do. \r\n\r\n<h3 id=\"children\">Childrens Ministry</h3>\r\nIf you are looking for a way to plug into our Childrens Ministry, we ask that you sign up at the Childrens Ministry table in the \'\'Kid\'s Lobby.\'\'  \r\nWe will contact you about the process itself, and give you the information you will need as you pray through your involvement.  If you simply want more information on our Childrens Ministry, please look through our Document Library.  If you have any questions, you may contact James Shields at 971-327-2120.  The after-hours Childrens Ministry line is 971-327-2120, extension 106.\r\n\r\n\r\n<h3 id=\"parking\">Parking</h3>\r\nWe direct traffic before and after services. We also have a crew of guys that stroll the parking lot during services for security purposes. If you are interested in getting involved in the security rotation, please call Eric Dodson at 971-327-2120.\r\n\r\n\r\n<h3 id=\"servant\">Servant Ministry</h3>\r\nThe leadership of ACCF has been on the lookout for ways to connect the needs within the body, with the people of our body. Many people are looking for ways to get more plugged into the church, and to exercise their spiritual gifts. This Servant Ministry is really just a structure we have put in place to provide Athey Creekers with practical opportunities to serve other members of the church body. Whether on the giving or the receiving end, we know that scores of people will be blessed by the fruit of this ministry. If you are feeling the desire to serve, please pick up a flier from the information table in the foyer. If you have any questions, feel free to contact Kaipo or Kari at the church office at \r\n971-327-2120.',NULL,'###How to Get Plugged In\r\n\r\n###The Importance of Fellowship\r\n\r\nIn Christ, there are no strangers but instead brothers and sisters. Ephesians 2:19-21 reminds us of this, \'\'Now, therefore you are no longer strangers and foreigners, but fellow citizens with the saints and members of the household of God, having been built on the foundation of the apostles and prophets, Jesus Christ Himself being the chief cornerstone in whom the whole building, being fitted together, grows into a holy temple in the Lord, in whom you also are being built together for a dwelling place of God in the Spirit.\'\' Christ desires for us to find our place in the fellowship - we are the living stones that build His house.\r\n\r\n###Getting Started\r\nThe first step is to try to get to know the pastors, elders, deacons and staff at Athey Creek.  Our pastors and elders are always available at the close of each service, and they would love the chance to meet you.  These men are also available for prayer, to answer questions or just to chat. If you are looking for further ways to connect, there are several ways to do this.\r\n\r\n###Events\r\nWhether it is retreats, Family Camp, rafting or BBQs, there are plenty of chances to meet members of the body outside of our Sundays and Wednesdays together. Watch for information in the church bulletin or on the [calendar page](/20/events/ \"calendar page\").\r\n\r\n###Serving\r\nAnother way to get involved is to serve. There are several ministries at Athey Creek where the focus is on meeting the needs of others.\r\n\r\n- [Childrens ministry](/101/about/getting-involved/#children \"Children\'s ministry\")\r\n- [Parking Lot](/101/about/getting-involved/#parking \"Parking Lot\")\r\n- [Servant Ministry](/101/about/getting-involved/#servant \"Servant Ministry\")\r\n\r\nThese are all ways to be a part of what the Lord is doing at Athey. You can call the church office for more information on any opportunities to serve.\r\n\r\nIf you are new to the fellowship, we invite you to simply enjoy the Lord and take in the Word for a few months. We hope this will be a time of refreshment for you, allowing you to get a feel for our flavor and understand the why behind much of what we do. \r\n\r\n<h3 id=\"children\">Childrens Ministry</h3>\r\nIf you are looking for a way to plug into our Childrens Ministry, we ask that you sign up at the Childrens Ministry table in the \'\'Kid\'s Lobby.\'\'  \r\nWe will contact you about the process itself, and give you the information you will need as you pray through your involvement.  If you simply want more information on our Childrens Ministry, please look through our Document Library.  If you have any questions, you may contact James Shields at 971-327-2120.  The after-hours Childrens Ministry line is 971-327-2120, extension 106.\r\n\r\n\r\n<h3 id=\"parking\">Parking</h3>\r\nWe direct traffic before and after services. We also have a crew of guys that stroll the parking lot during services for security purposes. If you are interested in getting involved in the security rotation, please call Eric Dodson at 971-327-2120.\r\n\r\n\r\n<h3 id=\"servant\">Servant Ministry</h3>\r\nThe leadership of ACCF has been on the lookout for ways to connect the needs within the body, with the people of our body. Many people are looking for ways to get more plugged into the church, and to exercise their spiritual gifts. This Servant Ministry is really just a structure we have put in place to provide Athey Creekers with practical opportunities to serve other members of the church body. Whether on the giving or the receiving end, we know that scores of people will be blessed by the fruit of this ministry. If you are feeling the desire to serve, please pick up a flier from the information table in the foyer. If you have any questions, feel free to contact Kaipo or Kari at the church office at \r\n971-327-2120.',619,'<h3>How to Get Plugged In</h3>\n\n<h3>The Importance of Fellowship</h3>\n\n<p>In Christ, there are no strangers but instead brothers and sisters. Ephesians 2:19-21 reminds us of this, &#8221;Now, therefore you are no longer strangers and foreigners, but fellow citizens with the saints and members of the household of God, having been built on the foundation of the apostles and prophets, Jesus Christ Himself being the chief cornerstone in whom the whole building, being fitted together, grows into a holy temple in the Lord, in whom you also are being built together for a dwelling place of God in the Spirit.&#8221; Christ desires for us to find our place in the fellowship - we are the living stones that build His house.</p>\n\n<h3>Getting Started</h3>\n\n<p>The first step is to try to get to know the pastors, elders, deacons and staff at Athey Creek.  Our pastors and elders are always available at the close of each service, and they would love the chance to meet you.  These men are also available for prayer, to answer questions or just to chat. If you are looking for further ways to connect, there are several ways to do this.</p>\n\n<h3>Events</h3>\n\n<p>Whether it is retreats, Family Camp, rafting or BBQs, there are plenty of chances to meet members of the body outside of our Sundays and Wednesdays together. Watch for information in the church bulletin or on the <a href=\"/20/events/\" title=\"calendar page\">calendar page</a>.</p>\n\n<h3>Serving</h3>\n\n<p>Another way to get involved is to serve. There are several ministries at Athey Creek where the focus is on meeting the needs of others.</p>\n\n<ul>\n<li><a href=\"/101/about/getting-involved/#children\" title=\"Children\'s ministry\">Childrens ministry</a></li>\n<li><a href=\"/101/about/getting-involved/#parking\" title=\"Parking Lot\">Parking Lot</a></li>\n<li><a href=\"/101/about/getting-involved/#servant\" title=\"Servant Ministry\">Servant Ministry</a></li>\n</ul>\n\n<p>These are all ways to be a part of what the Lord is doing at Athey. You can call the church office for more information on any opportunities to serve.</p>\n\n<p>If you are new to the fellowship, we invite you to simply enjoy the Lord and take in the Word for a few months. We hope this will be a time of refreshment for you, allowing you to get a feel for our flavor and understand the why behind much of what we do.</p>\n\n<h3 id=\"children\">Childrens Ministry</h3>\n\n<p>If you are looking for a way to plug into our Childrens Ministry, we ask that you sign up at the Childrens Ministry table in the &#8221;Kid&#8217;s Lobby.&#8221;<br />\nWe will contact you about the process itself, and give you the information you will need as you pray through your involvement.  If you simply want more information on our Childrens Ministry, please look through our Document Library.  If you have any questions, you may contact James Shields at 971-327-2120.  The after-hours Childrens Ministry line is 971-327-2120, extension 106.</p>\n\n<h3 id=\"parking\">Parking</h3>\n\n<p>We direct traffic before and after services. We also have a crew of guys that stroll the parking lot during services for security purposes. If you are interested in getting involved in the security rotation, please call Eric Dodson at 971-327-2120.</p>\n\n<h3 id=\"servant\">Servant Ministry</h3>\n\n<p>The leadership of ACCF has been on the lookout for ways to connect the needs within the body, with the people of our body. Many people are looking for ways to get more plugged into the church, and to exercise their spiritual gifts. This Servant Ministry is really just a structure we have put in place to provide Athey Creekers with practical opportunities to serve other members of the church body. Whether on the giving or the receiving end, we know that scores of people will be blessed by the fruit of this ministry. If you are feeling the desire to serve, please pick up a flier from the information table in the foyer. If you have any questions, feel free to contact Kaipo or Kari at the church office at \n971-327-2120.</p>\n'),
	(120,12487,NULL,'In 1996, Brett Meador moved with his family from Southern Oregon to Portland to start Athey Creek Christian Fellowship. The first Sunday morning service was held at Athey Creek Middle School. Wednesday Bible study took place in a little building around the corner from the school.\r\n\r\nFrom the beginning, we have envisioned the church as a refuge, a place where those who are lost, hurting, or just plain worn out can find a haven from the chaos of the world in which we live. Our desire is to see people grow strong in their relationship with Jesus. We believe the best way to accomplish this is to study right through the Bible, receiving the \'full counsel of God.\' The result, we pray, is a place like the New Testament church where the study of God\'s Word, prayer, communion and fellowship with other believers will cause us to grow in our love relationship with Jesus, and allow us to be lights in this dark world.\r\n\r\n[Meet the staff at Athey](/103/about/staff/)',NULL,'In 1996, Brett Meador moved with his family from Southern Oregon to Portland to start Athey Creek Christian Fellowship. The first Sunday morning service was held at Athey Creek Middle School. Wednesday Bible study took place in a little building around the corner from the school.\r\n\r\nFrom the beginning, we have envisioned the church as a refuge, a place where those who are lost, hurting, or just plain worn out can find a haven from the chaos of the world in which we live. Our desire is to see people grow strong in their relationship with Jesus. We believe the best way to accomplish this is to study right through the Bible, receiving the \'full counsel of God.\' The result, we pray, is a place like the New Testament church where the study of God\'s Word, prayer, communion and fellowship with other believers will cause us to grow in our love relationship with Jesus, and allow us to be lights in this dark world.\r\n\r\n[Meet the staff at Athey](/103/about/staff/)',169,'<p>In 1996, Brett Meador moved with his family from Southern Oregon to Portland to start Athey Creek Christian Fellowship. The first Sunday morning service was held at Athey Creek Middle School. Wednesday Bible study took place in a little building around the corner from the school.</p>\n\n<p>From the beginning, we have envisioned the church as a refuge, a place where those who are lost, hurting, or just plain worn out can find a haven from the chaos of the world in which we live. Our desire is to see people grow strong in their relationship with Jesus. We believe the best way to accomplish this is to study right through the Bible, receiving the &#8216;full counsel of God.&#8217; The result, we pray, is a place like the New Testament church where the study of God&#8217;s Word, prayer, communion and fellowship with other believers will cause us to grow in our love relationship with Jesus, and allow us to be lights in this dark world.</p>\n\n<p><a href=\"/103/about/staff/\">Meet the staff at Athey</a></p>\n'),
