	(155,12631,NULL,'Home Groups meet twice a month on Sundays to fellowship from house-to-house around the Portland Metro Area.  This is a great way to get to know other believers in a smaller setting, spend time in the Word, pray for one another and celebrate the sacrifice Jesus made for us on the cross.  Ultimately, our hope is that these groups are a place where Athey Creekers are strengthened, cared for and joined together.  So, we encourage you to find a home group that is a good fit and plug in!\r\n\r\nFeel free to contact the leaders for more information about a specific home group.  If you have general questions about home groups, you can send an email to homegroups@atheycreek.com or call Mike Marugg at 503.803.0868.',NULL,'Home Groups meet twice a month on Sundays to fellowship from house-to-house around the Portland Metro Area.  This is a great way to get to know other believers in a smaller setting, spend time in the Word, pray for one another and celebrate the sacrifice Jesus made for us on the cross.  Ultimately, our hope is that these groups are a place where Athey Creekers are strengthened, cared for and joined together.  So, we encourage you to find a home group that is a good fit and plug in!\r\n\r\nFeel free to contact the leaders for more information about a specific home group.  If you have general questions about home groups, you can send an email to homegroups@atheycreek.com or call Mike Marugg at 503.803.0868.',123,'<p>Home Groups meet twice a month on Sundays to fellowship from house-to-house around the Portland Metro Area.  This is a great way to get to know other believers in a smaller setting, spend time in the Word, pray for one another and celebrate the sacrifice Jesus made for us on the cross.  Ultimately, our hope is that these groups are a place where Athey Creekers are strengthened, cared for and joined together.  So, we encourage you to find a home group that is a good fit and plug in!</p>\n\n<p>Feel free to contact the leaders for more information about a specific home group.  If you have general questions about home groups, you can send an email to homegroups@atheycreek.com or call Mike Marugg at 503.803.0868.</p>\n'),
	(157,12482,NULL,'## \"Where there is no vision, the people perish...\" -Proverbs 29:18\r\n\r\nProverbs 29:18 tells us, \"Without vision, the people perish.\" Biblically, vision typically means God-given revelation and the Hebrew word for perish, used here in Proverbs, is a picture of someone running around like a madman. Without a vision for our fellowship, we would be like the madman, running aimlessly. The Lord has given our leadership a clear direction for us as a church, a mode in which we are to function.\r\n\r\n###A Ministry of Simplicity\r\nThe very heart of what we strive after is keeping Jesus the focal point of everything! There are many good things we could be doing in the way of programs or presentation; however, we have made the decision to keep it simple. We feel called to preserve our fellowship as a place patterned after the early church of the New Testament. Our model for this is found in Acts 2:42: \"And they continued steadfastly in the apostles doctrine and fellowship, and in breaking of bread, and in prayers.\"\r\n\r\n- The Apostles Doctrine  teaching the Word\r\n- Fellowship  friendship, interaction that is rich and centered on the Lord\r\n- Breaking of Bread  eating together, sharing meals, and communion\r\n- Prayer  worship, praying with one another, praying for one another, time alone before the Lord\r\n\r\nYou will find that there are plenty of opportunities throughout the week to be fed from the Word, to worship, to fellowship, to pray and to take communion. We hope that you are refreshed as you make the most of these times.\r\n\r\n###A Ministry of Humility\r\nThere are many other good churches in the area that do things very differently than we do, and they do them well! While we are very certain of what the Lord has called us to do, we are quick to recognize that we are no better than any other fellowship. Pastor Brett likes to joke, \"Were better than nothing!\" We are just another body of believers, seeking to know the Lord better and to bring others to Him.\r\n\r\n###A Ministry of Sincerity\r\nWe live in a fast-paced, busy world. Flashy commercials, computer technology, crazy traffic ... our lives are about doing more, doing better, doing faster. Church can become the same way. It is another thing we guard against. We try to remember that the church is to be a hospital, a place of healing and refreshment. It is not to be a place of recruitment. We do not want you to come here, after a busy week, and feel like you have to do more, be more, pay more. So sit back and enjoy. Spend time before the Lord in worship. Drink deeply of His Word. Receive from Him. Take pleasure in the time you have to be still before Him.',NULL,'## \"Where there is no vision, the people perish...\" -Proverbs 29:18\r\n\r\nProverbs 29:18 tells us, \"Without vision, the people perish.\" Biblically, vision typically means God-given revelation and the Hebrew word for perish, used here in Proverbs, is a picture of someone running around like a madman. Without a vision for our fellowship, we would be like the madman, running aimlessly. The Lord has given our leadership a clear direction for us as a church, a mode in which we are to function.\r\n\r\n###A Ministry of Simplicity\r\nThe very heart of what we strive after is keeping Jesus the focal point of everything! There are many good things we could be doing in the way of programs or presentation; however, we have made the decision to keep it simple. We feel called to preserve our fellowship as a place patterned after the early church of the New Testament. Our model for this is found in Acts 2:42: \"And they continued steadfastly in the apostles doctrine and fellowship, and in breaking of bread, and in prayers.\"\r\n\r\n- The Apostles Doctrine  teaching the Word\r\n- Fellowship  friendship, interaction that is rich and centered on the Lord\r\n- Breaking of Bread  eating together, sharing meals, and communion\r\n- Prayer  worship, praying with one another, praying for one another, time alone before the Lord\r\n\r\nYou will find that there are plenty of opportunities throughout the week to be fed from the Word, to worship, to fellowship, to pray and to take communion. We hope that you are refreshed as you make the most of these times.\r\n\r\n###A Ministry of Humility\r\nThere are many other good churches in the area that do things very differently than we do, and they do them well! While we are very certain of what the Lord has called us to do, we are quick to recognize that we are no better than any other fellowship. Pastor Brett likes to joke, \"Were better than nothing!\" We are just another body of believers, seeking to know the Lord better and to bring others to Him.\r\n\r\n###A Ministry of Sincerity\r\nWe live in a fast-paced, busy world. Flashy commercials, computer technology, crazy traffic ... our lives are about doing more, doing better, doing faster. Church can become the same way. It is another thing we guard against. We try to remember that the church is to be a hospital, a place of healing and refreshment. It is not to be a place of recruitment. We do not want you to come here, after a busy week, and feel like you have to do more, be more, pay more. So sit back and enjoy. Spend time before the Lord in worship. Drink deeply of His Word. Receive from Him. Take pleasure in the time you have to be still before Him.',458,'<h2>&#8220;Where there is no vision, the people perish&#8230;&#8221; -Proverbs 29:18</h2>\n\n<p>Proverbs 29:18 tells us, &#8220;Without vision, the people perish.&#8221; Biblically, vision typically means God-given revelation and the Hebrew word for perish, used here in Proverbs, is a picture of someone running around like a madman. Without a vision for our fellowship, we would be like the madman, running aimlessly. The Lord has given our leadership a clear direction for us as a church, a mode in which we are to function.</p>\n\n<h3>A Ministry of Simplicity</h3>\n\n<p>The very heart of what we strive after is keeping Jesus the focal point of everything! There are many good things we could be doing in the way of programs or presentation; however, we have made the decision to keep it simple. We feel called to preserve our fellowship as a place patterned after the early church of the New Testament. Our model for this is found in Acts 2:42: &#8220;And they continued steadfastly in the apostles doctrine and fellowship, and in breaking of bread, and in prayers.&#8221;</p>\n\n<ul>\n<li>The Apostles Doctrine  teaching the Word</li>\n<li>Fellowship  friendship, interaction that is rich and centered on the Lord</li>\n<li>Breaking of Bread  eating together, sharing meals, and communion</li>\n<li>Prayer  worship, praying with one another, praying for one another, time alone before the Lord</li>\n</ul>\n\n<p>You will find that there are plenty of opportunities throughout the week to be fed from the Word, to worship, to fellowship, to pray and to take communion. We hope that you are refreshed as you make the most of these times.</p>\n\n<h3>A Ministry of Humility</h3>\n\n<p>There are many other good churches in the area that do things very differently than we do, and they do them well! While we are very certain of what the Lord has called us to do, we are quick to recognize that we are no better than any other fellowship. Pastor Brett likes to joke, &#8220;Were better than nothing!&#8221; We are just another body of believers, seeking to know the Lord better and to bring others to Him.</p>\n\n<h3>A Ministry of Sincerity</h3>\n\n<p>We live in a fast-paced, busy world. Flashy commercials, computer technology, crazy traffic &#8230; our lives are about doing more, doing better, doing faster. Church can become the same way. It is another thing we guard against. We try to remember that the church is to be a hospital, a place of healing and refreshment. It is not to be a place of recruitment. We do not want you to come here, after a busy week, and feel like you have to do more, be more, pay more. So sit back and enjoy. Spend time before the Lord in worship. Drink deeply of His Word. Receive from Him. Take pleasure in the time you have to be still before Him.</p>\n');
