	(164,105,NULL,'Brett is our senior pastor. He and his family moved to Portland in 1996 to start Athey Creek Christian Fellowship. Brett and his wife Debbie have three children  Brooke, Joe and Casey.',NULL,'Brett is our senior pastor. He and his family moved to Portland in 1996 to start Athey Creek Christian Fellowship. Brett and his wife Debbie have three children  Brooke, Joe and Casey.',31,'<p>Brett is our senior pastor. He and his family moved to Portland in 1996 to start Athey Creek Christian Fellowship. Brett and his wife Debbie have three children  Brooke, Joe and Casey.</p>\n'),
	(165,106,NULL,'Jeff is an assisting pastor who handles the business dealings of our fellowship. Presently, his focus is working with the various agencies, contractors and lenders to coordinate the pace and flow of the building project. Jeff and his wife, Sherry, have a ',NULL,'Jeff is an assisting pastor who handles the business dealings of our fellowship. Presently, his focus is working with the various agencies, contractors and lenders to coordinate the pace and flow of the building project. Jeff and his wife, Sherry, have a daughter named Caedy.',45,'<p>Jeff is an assisting pastor who handles the business dealings of our fellowship. Presently, his focus is working with the various agencies, contractors and lenders to coordinate the pace and flow of the building project. Jeff and his wife, Sherry, have a daughter named Caedy.</p>\n'),
