	(139,12548,NULL,'Kaipo spends much of his time taking care of the maintenance and cleaning needs of the church building. He also heads up many of the improvement projects around the church.',NULL,'Kaipo spends much of his time taking care of the maintenance and cleaning needs of the church building. He also heads up many of the improvement projects around the church.',30,'<p>Kaipo spends much of his time taking care of the maintenance and cleaning needs of the church building. He also heads up many of the improvement projects around the church.</p>\n'),
